INSERT INTO `uni_video` VALUES ('aM5scnNzA2ACFT', '天赐的声音 第三季', '//m.ykimg.com/050E00006227294C13EB66098E5513C8', '音乐,选秀', '陈欢', '陈欢,胡海泉,胡彦斌,张韶涵,周深,GAI周延,吉克隽逸,希林娜依·高,陈意涵,信,康姆士乐团,阿云嘎,金润吉,梁龙,肖若腾,张碧晨,檀健次,孟佳,张紫宁,李铢衔,潘辰,宝石Gem,陈鸿宇,马吟吟,符龙飞,刘凤瑶,王赫野,刘惜君,赵磊,胡梦周,戴羽彤,房东的猫,汪小敏,伍珂玥,李紫婷,锤娜丽莎,米卡,戴燕妮,陈冰,海来阿木,谢可寅,朱星杰,黄霄雲,姚琛,连淮伟,孟慧圆,赖美云,张赫宣,李巍,裘德,王弦', '2022-05-29期', 3, '', '《天赐的声音》陪伴观众度过两年时光，带来了很多优秀的音乐作品，是一个非常用心的音乐节目，致力于对音乐创作进行深度的探讨和挖掘。好的音乐需要好的契机，《天赐的声音》给音乐提供了一个优秀的平台，成为作品与观众之间的连接。作为浙江卫视综艺品牌，《天赐的声音》不断挖掘和追寻，不仅给各种音乐审美带来了汇聚与碰撞的舞台，还不断通过创新的形式给观众带来动听的音乐作品。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('aMAoa3N072QBFD', '乘风破浪 第三季', '//1img.mgtv.com/preview/sp_images/2022/05/16/202205160924532356850.jpg', '其他', '未知', '未知', '2022-05-27期', 3, '', '《乘风破浪》第三季是由芒果TV自制，关注30+女性的舞台竞演类综艺。节目集结了30位优秀的歌手、演员、舞蹈艺术家等，在专业制作团的全程协助下，一同突破自我为观众呈现精彩舞台的过程。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('aMEla3NzAJk4Dj', '一起露营吧', 'http://localhost:9660/video/pics/d318806afc59442fa1ce801d09ecabcf.jpg', '真人秀,爱奇艺出品', '未知', '陈伟霆,黄雅莉,王子异,杨迪,钟楚曦,章若楠,朱云峰,王源', '2022-05-26期', 3, '', '节目将召集热爱生活但性格各异的潮玩明星，组成潮流露营家族，在五站画风极致的营地中，展开两天一夜由易到难、由浅入深的进阶露营生活，为观众输出一本露营潮玩白皮书。', 0, 0.0);
INSERT INTO `uni_video` VALUES ('f6jrZxH4RnP2SR', '特种保镖', '//p0.qhimg.com/t01aaa1242d197e1d9c.jpg', '动作,犯罪,悬疑', '周天宇', '张博楠,李雨阳,陈语桐', '2018-01-15', 1, 'http://www.iqiyi.com/v_19rresi5vc.html?vfm=f_191_360y&fv=p_09_01', '身为特战队员的张天择在一次缉毒任务“驱魔行动”中误伤了自己的战友，陷入深深自责的张天择选择离开特战队。机缘巧合成为了富豪千金小雅的贴身保镖，两人渐渐成为了忘年交。但好景不长，曾经的犯罪团伙余孽绑架了小雅，并要挟张天择二十四小时内必须将毒品红粉骷髅的配方磁盘找到并交出来。张天择能不能找到红粉骷髅磁盘？能不能成功解决小雅？一场特战风暴即将拉开序幕。', 1, 6.5);
INSERT INTO `uni_video` VALUES ('f6LiZBH6Rnb6UB', '熊出没·重返地球', '//p0.qhimg.com/t015a7834ef68c02308.png', '喜剧,剧情,动画', '丁亮', '熊二,熊大,光头强', '2022-02-01', 1, 'http://www.mgtv.com/b/423256/15818949.html?cxid=90f0zbamf', '神秘的“外星人”阿布造访狗熊岭，结识熊二后得知阿布一族起源于地球，他们离开地球时在南极封存了大量遗迹宝藏，这引来了反派牛夫妇的觊觎，大伙掉入圈套。绝境中，熊二和大家一起打败反派，守卫阿布最后的家园。', 1, 5.6);
INSERT INTO `uni_video` VALUES ('f6LjZhH6S0P2Sh', '青面修罗', '//i1.letvimg.com/lc06_isvrs/202205/11/10/45/31dbbc4d-31ab-416b-9bce-08f0fff107d8.jpg', '剧情,悬疑,动作', '李仁港', '冯绍峰,胡军,许晴,金晨,王庆祥,高捷,曾江,吕良伟,徐少强,吴岱融,盛鉴,修庆,杜玉明,袁祥仁,闵正,吴冬妮,李沛泽,石小满,艾力江·库尔班,马小茜', '2022-05-18', 1, 'http://www.mgtv.com/b/445012/16220443.html?cxid=90f0zbamf', '电影《青面修罗》讲述了在群雄割据的混乱时代，各国尔虞我诈数十载，均陷至经济困境，民不聊生。其中还能屹立不倒的以李景的南陵、孟旭的西川和柴胜的东桑为最。而游离于诸国纷争之外的刺客组织——离恨谷，是各国为称霸而争相笼络的砝码，也是闻风丧胆的梦魇。主人公齐君元（冯绍峰饰）便是离恨谷刺客之一，他自幼因家族变故入谷，但一直牢记着为族人报仇的使命，此次藏宝铜片再现，他抓住千载难逢的机会，不顾谷主金锣太岁的阻拦，深入敌穴，一场以局破局的冒险之旅就此展开。', 1, 8.0);
INSERT INTO `uni_video` VALUES ('f6PmZkQsQXn7Sh', '一眉道人', '//img6.pplive.cn/2011/08/18/09364485673_230X306.jpg', '奇幻,恐怖', '林正英', '林正英,钱小豪,吕方,吴君如,楼南光,玛利亚,陈敬,玛俐亚,陈佩珊,简慧珍,林正宏,叶璿,法兰·祖哈斯,刘玉婷,简慧真,陈雪雯,钱月笙,罗青浩,李擎柱,黄智强', '1989-07-26', 1, 'https://m.ixigua.com/video/6938064141907132941?utm_source=360_lvideo', '一眉道人（林正英 饰）修为高强，擅长茅山道术，和徒弟阿豪（钱小豪 饰）住在一个小镇上；他养了一只清朝的小僵尸，小僵尸经常帮他和阿豪办事。一天，一眉道人被邻镇的人邀请去捉鬼，因为邻镇瘟疫蔓延，不时有僵尸出没。一眉道人带上阿豪和小僵尸出发了。\r\n在邻镇一眉道人他们遇上了一群修女，阿豪弄出不少笑话。一眉道人发现邻镇的引用水源都被尸毒污染，不能饮用，于是和阿豪一起寻找水源。他在教堂的地下室发现了僵尸的痕迹，原来此处本来放着一具西洋僵尸，邻镇乡公所的所长意外令西洋僵尸复活了。一场精彩的中国法术对付西洋僵尸的好戏上演了。', 1, 7.6);
INSERT INTO `uni_video` VALUES ('f6TiZBH1RHj8Sh', '太平轮（下）·彼岸', '//p0.qhimg.com/t01232bcffc1cc1f1db.jpg', '剧情,爱情', '吴宇森', '章子怡,金城武,宋慧乔,黄晓明,佟大为,长泽雅美,杨祐宁,俞飞鸿,王千源,秦海璐,杨贵媚,丛珊,吴飞霞,于震,林保怡,林美秀,高捷,黄柏钧,寇家瑞,许还幻,尤勇,刘仪伟,黑木瞳,李威,寇世勋', '2015-07-30', 1, 'http://www.mgtv.com/b/156827/3049774.html?cxid=90f0zbamf', '战争年代，时局动荡，人民颠沛流离。\r\n三对不同背景的主人公被卷入硝烟与战火，与挚爱分离。国军军官雷义方（黄晓明 饰）生死不明，太太（宋慧乔 饰）独在台湾饱受相思之苦；军医严泽坤（金城武 饰）与青梅竹马的日本女孩雅子（长泽雅美 饰）因政局变化被分隔，再难相见；底层女性于真（章子怡 饰）和通信兵（佟大为 饰）萍水相逢，又被乱世冲散；尽管命途颠簸，但他们仍不惜与命运奋力抗争，书写了战乱年代的悲欢离合。最终，命运的齿轮将所有人卷入逃难的太平轮上，他们会如何相遇，各自的命运又将何去何从？', 1, 6.6);
INSERT INTO `uni_video` VALUES ('faLkYRH6Rnb7UB', '这个杀手不太冷静', '//p0.qhimg.com/t013e47b1c559adc308.png', '喜剧', '邢文雄', '马丽,魏翔,陈明昊,周大勇,黄才伦,高海宝,韩笑,艾伦,孙贵权,许猛,全容杓,卜俊男,张志忠,张建新,马驰,陶亮,何欣悦,詹卢卡·佐帕', '2022-02-01', 1, 'http://www.mgtv.com/b/408964/15759599.html?cxid=90f0zbamf', '魏成功，为了实现自己毕生的梦想——饰演一次男主角，意外闯入了一个危机四伏的骗局。他凭借自己的“精湛”演技和绝佳的运气，一次次化险为夷。可当他最终得知所谓的“男主角”不过是一场梦，他又该何去何从。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('faTmaEondXT5Tx', '大醉侠', '//p5.qhimg.com/t01e002a8fb867c2439.png', '动作,剧情', '胡金铨', '郑佩佩,岳华,陈鸿烈,杨志卿,韩英杰,成龙,元彪,江洋,程小东,谷峰,袁小田,李允中,潘迎紫,Hei Chan,徐忠信,冯毅,郝履仁,徐虾,火星,沈劳,王若平,任浩,张照,林健全,王冲,关应炽,夏雨,蓝伟烈,赵雄,赵心妍,吴明才', '1966-01-01', 1, 'http://tv.sohu.com/v/MjAxNzA0MTMvbjQ4ODEwMjg5OC5zaHRtbA==.html?txid=e3a4b335ff108a628d3314e4c839ce0d', '江湖败类“索命五虎”作恶多端，杀人如麻。其老大被两江总督张大人俘获，不日问斩。其余四虎铤而走险，劫走张大人之子张步青以作要挟。张步青之妹张熙燕（郑佩佩 饰）武艺高强，人送绰号“金燕子”。为救兄长，张熙燕独闯虎穴，然恶徒狡猾非常，金燕子救兄不成，还险些丢掉性命。关键时刻，幸得隐于江湖的侠客范大悲（岳华 饰）出手搭救。\n范大悲曾为某寺院修行者，其师兄了空大师为夺掌门人之位杀害师傅，师傅临死前将丐帮掌门人信物交给范大悲。念及师兄弟之情，范从此隐姓埋名，以醉猫的诨号浪荡江湖。此次索命五虎与了空大师联手，势要将金燕子和范大悲斩草除根……', 1, 7.5);
INSERT INTO `uni_video` VALUES ('faXiYRH2QXTASB', '唐人街探案', '//p3.qhimg.com/t01a9564d07e0ccdba4.jpg', '喜剧,悬疑', '陈思诚', '王宝强,刘昊然,佟丽娅,陈赫,肖央,小沈阳,陈思诚,潘粤明,马浴柯,张子枫,赵英俊,桑平,董成鹏,潘斌龙,金士杰,大鹏,张国强,李叶青,陈祉希,张大大,戴墨', '2015-12-31', 1, 'http://www.mgtv.com/b/159286/2975893.html?cxid=90f0zbamf', '天赋异禀的结巴少年秦风（刘昊然 饰）警校落榜，被姥姥遣送泰国找远房表舅——号称“唐人街第一神探”，实则“猥琐”大叔的唐仁（王宝强 饰）散心。不想一夜花天酒地后，唐仁沦为离奇凶案嫌疑人，不得不和秦风亡命天涯…… 穷追不舍的警探——“疯狗”黄兰登（陈赫 饰）；无敌幸运的警察——“草包”坤泰（肖央 饰）；穷凶极恶、阴差阳错的“匪帮三人组”；高深莫测的“唐人街教父”；“美艳风骚老板娘”等悉数登场！七天！唐仁、秦风这对“欢喜冤家”、“天作之合”必须取长补短、同仇敌忾！他们能否在躲避警察追捕、匪帮追杀、黑帮围剿的同时，在短短“七天”内，完成找到“失落的黄金”、查明“真凶”、为自己“洗清罪名”这些“逆天”的任务？', 1, 7.5);
INSERT INTO `uni_video` VALUES ('faXmYRH3SHHAUB', '猪猪侠之英雄猪少年', '//img3.doubanio.com/view/movie_poster_cover/lpst/public/p2399948567.jpg', '喜剧,动画,奇幻', '陆锦明,钟裕', '易烊千玺,陈轶,张子琨,戎妍,庄承松,李泰承,刘青阳,陈志荣,彭雨菲,黎泰承,陈昱霖,张页川', '2017-01-07', 1, 'http://www.mgtv.com/b/309588/3854035.html?cxid=90f0zbamf', '传奇五灵锁拥有可以保护世界的神奇力量，却阴差阳错地选中了“一无是处”的猪猪侠（张子琨 配音）作为它的主人，此时出现了一个可怕的黑衣人，他的目标竟是要毁掉所有的五灵锁。初出茅庐的猪猪侠迎难而上，经历重重较量，猪猪侠发现了黑衣人竟然是十三年后的自己……', 1, 5.1);
INSERT INTO `uni_video` VALUES ('faXpYRH6Rnb4UR', '狙击手 2022', '//1img.mgtv.com/preview/sp_images/2022/01/30/202201301023442584776.jpg', '剧情,动作,战争', '张艺谋,张末', '陈永胜,章宇,刘浩存,王乃训,张译', '2022-01-01', 1, 'http://www.mgtv.com/b/373475/15759609.html?cxid=90f0zbamf', '影片以抗美援朝战争中“冷枪冷炮”运动为背景，通过一段中国志愿军狙击小 队与美军精英狙击队之间的殊死对决，展现了朝鲜战场上志愿军战士艰难取胜的英勇故事和可歌可泣的奉献精神。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('fqroZhH1S0H0Th', '夏洛特烦恼', '//p2.qhimg.com/t01fb78376e67f4ebec.jpg', '喜剧,爱情', '闫非,彭大魔', '沈腾,马丽,尹正,艾伦,王智,田雨,宋阳,常远,李萍,李立群,张一鸣,常世奎,刘坤,黄才伦,陈昊明,陆林洁,王成思,刘金,刘立东,杨欢,宁幻秋,温森,陶柏,许猛,嫣红,刘叶舟,王硕,马驰,马小茜,赵震,董良瑜,周展翅,周华安,顾佳欣,易波,一戈,姜田丰,郭恩强,于健,王琦,赵雪,陶亮,黄杨,陆羊,王军,冯满,刘子凡,刘笑竹,芦莹,张广浩,方菲菲,许登雨,朱波,肖扬,魏翔', '2015-09-30', 1, 'http://www.mgtv.com/b/156506/1860458.html?cxid=90f0zbamf', '昔日校花秋雅（王智 饰）的婚礼正在隆重举行，学生时代暗恋秋雅的夏洛（沈腾 饰）看着周围事业成功的老同学，心中泛起酸味，借着七分醉意大闹婚礼现场，甚至惹得妻子马冬梅（马丽 饰）现场发飙，而他发泄过后却在马桶上睡着了。梦里他重回校园，追求到他心爱的女孩、让失望的母亲重展笑颜、甚至成为无所不能的流行乐坛巨星……\r\n醉生梦死中，他发现身边人都在利用自己，只有马冬梅是最值得珍惜的……', 1, 7.6);
INSERT INTO `uni_video` VALUES ('g6bkaRH6RXb4TR', '我和我的父辈', '//p0.qhimg.com/t0183d2d8481e9e14e2.png', '剧情,文艺', '吴京,章子怡,徐峥,沈腾', '吴京,章子怡,徐峥,沈腾,吴磊,黄轩,韩昊霖,洪烈,张天爱,袁近辉,宋佳,马丽,李光洁,陈道明,张艺谋,李雪健,余皑磊,海清,欧豪,艾伦,魏晨,白那日苏,江水,逯长恩,张恒瑞,阿楠,任思诺,彭昱畅,李乃文,耿乐,杜江,陶虹,贾冰,张雨绮,焦圣祥,倪虹洁,樊雨洁,张建亚,张芝华,张国强,宁理,胡可,沙溢,马书良,曹可凡,万茜,祖峰,周庆昀,辣目洋子,常远,张小斐,吴昱翰,祖锋,吴昊宸,王成思,宋阳,李海银,龚毅星,段奕宏,张艺兴,王一博,萨日娜,马嘉祺,刘佩琦,王俊凯,刘德华,刘昊然,关晓彤', '2021-10-01', 1, 'http://www.mgtv.com/b/386365/15380241.html?cxid=90f0zbamf', '继2019年《我和我的祖国》、2020年《我和我的家乡》，国庆三部曲之《我和我的父辈》接棒定档2021年国庆。由吴京、章子怡、徐峥、沈腾导演，“中国电影追梦人”再次集结，以革命、建设、改革开放和新时代为历史坐标, 通过“家与国”的视角描写几代父辈的奋斗经历，讲述中国人的血脉相连和精神传承，再现中国人努力拼搏的时代记忆。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('g6fnZhH4SHT0UB', '我不是药神', '//p0.qhimg.com/t018839bbcde726cc55.jpg', '剧情,喜剧', '文牧野', '徐峥,王传君,谭卓,章宇,杨新鸣,周一围,王佳佳,王砚辉,贾晨飞,龚蓓苾,宁浩,李乃文,岳小军,苇青,富冠铭,巴拉特·巴蒂,喜利图,张海艳,朱耕佑,张子贤,宁晓志,杜家毅,邓飞,刘兴雷,陈翃,何李宁,马千壹,杜子蓝,刘頔,甘昀宸,石强,张翰尧,刘修齐', '2018-07-05', 1, 'http://www.mgtv.com/b/323492/4705829.html?cxid=90f0zbamf', '普通中年男子程勇（徐峥 饰）经营着一家保健品店，失意又失婚。不速之客吕受益（王传君 饰）的到来，让他开辟了一条去印度买药做“代购”的新事业，虽然困难重重，但他在这条“买药之路”上发现了商机，一发不可收拾地做起了治疗慢粒白血病的印度仿制药独家代理商。赚钱的同时，他也认识了几个病患及家属，为救女儿被迫做舞女的思慧（谭卓 饰）、说一口流利“神父腔”英语的刘牧师（杨新鸣 饰），以及脾气暴烈的“黄毛”（章宇 饰），几个人合伙做起了生意，利润倍增的同时也危机四伏。程勇昔日的小舅子曹警官（周一围 饰）奉命调查仿制药的源头，假药贩子张长林（王砚辉 饰）和瑞士正牌医药代表（李乃文 饰）也对其虎视眈眈，生意逐渐变成了一场关于救赎的拉锯战。\n本片改编自慢粒白血病患者陆勇代购抗癌药的真实事迹。', 1, 9.0);
INSERT INTO `uni_video` VALUES ('g6niZBH6Rnb8Th', '长津湖之水门桥', '//i3.letvimg.com/lc02_isvrs/202203/25/15/39/d80c8d1c-a16b-4d93-8279-7c8a47385bf7.jpg', '战争,历史,剧情', '陈凯歌,徐克,林超贤', '吴京,易烊千玺,朱亚文,胡军,李晨,段奕宏,韩东君,张涵予,耿乐,杜淳,李卓扬,杨一威,何跃飞,庄小龙,许明虎,王振威,陈泽轩,李小锋,郭建,王丽坤,詹姆斯·菲尔伯德,John F·Cruz', '2022-02-01', 1, 'http://www.mgtv.com/b/412685/16094083.html?cxid=90f0zbamf', '电影以抗美援朝战争第二次战役中的长津湖战役为背景，讲述了在结束了新兴里和下碣隅里的战斗之后，七连战士们又接到了更艰巨的任务……', 1, 7.9);
INSERT INTO `uni_video` VALUES ('g6njZhH6S0T3SB', '狄仁杰之夺命奇香', '//pic8.iqiyipic.com/image/20220520/cd/fe/v_167511660_m_601_m3_195_260.jpg', '喜剧,动作,奇幻', '谢宜', '杨冰,萧鸿鹏,王艺甜,王美英,包彦希（中国新歌声学员）,杨树林（演员）', '2022-05-22', 1, 'http://www.iqiyi.com/v_1106v5ispsc.html?vfm=f_191_360y&fv=p_09_01', '武周年间，洛阳当红舞妓含冤被斩，化厉鬼索命连环杀人。流放在外的第一神探狄仁杰被武后特赦并委任为钦差调查此案，不料在返城途中遭人刺杀坠崖失忆，被来洛阳寻妻却无法入城的落魄商贾吕昭元所救。二人阴差阳错身份掉包，假狄公（吕昭元）不得不在国相的监管下被迫查案，因伤痴巅的真狄公也机缘巧合回到洛阳，凭借查案本能和惊人的洞察力迅速掌握尸身奇香这一关键证据。真假狄公默契配合，利用各自优势不断逼近真相，“女鬼索命”的幕后真凶终于显露真身……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('g6PjYhH6R0X4TB', '侍神令', '//p0.qhimg.com/t01922cc30a22a22221.png', '剧情,奇幻', '李蔚然', '陈坤,周迅,陈伟霆,屈楚萧,王丽坤,沈月,王紫璇,张子枫,王悦伊,何涌生,张双利,李逸男,张子贤,伊然,刘若谷,艾米', '2021-02-12', 1, 'http://www.mgtv.com/b/342897/11378473.html?cxid=90f0zbamf', '穿行于人妖两界的阴阳师晴明（陈坤 饰），因与一众妖怪缔结契约，酿成大祸，深陷危机。而与此同时，妖皇势力正卷土重来，一场恶战一触即发。在风云突变、局势动荡的危急时刻，晴明恍然发现，自己人妖混血的身份，竟是这一切灾祸的关键......', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gabjYRH6S0LAUR', '别惹白鸽之她的秘密', '//4img.mgtv.com/preview/sp_images/2022/03/07/202203071448001307367.jpg', '悬疑,剧情', '未知', '王玥兮,周楚濋,董畅', '2022-05-03', 1, 'http://www.mgtv.com/b/430175/16086919.html?cxid=90f0zbamf', '情感小组主理人白鸽（王玥兮 饰）得知，小组成员舒然（周楚濋 饰）遭遇了婚姻危机，其丈夫刘洋（董畅 饰）竟在舒然提出离婚后，亲手将外遇对象溺死在自家浴缸中……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gajnZRH5RXP7SB', '新倩女幽魂', '//0img.mgtv.com/oldpic/preview/internettv/prev/KsImg/3ee4d852-01de-49c1-864b-fca967d1c01f.jpg', '爱情,恐怖,奇幻', '叶伟信', '古天乐,刘亦菲,余少群,惠英红,樊少皇,徐锦江,巩新亮,林鹏,李菁,王丹怡栗', '2011-04-19', 1, 'http://www.mgtv.com/b/7587/284296.html?cxid=90f0zbamf', '很多年以前，他就矢志要成为一个优秀的猎妖师，他选择了黑山做他修行和圆梦之旅的起点。他在黑山经历一场又一场的凶险恶斗，村民们都害怕进入黑山和这间“兰若寺”。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gaPnYRH6Rnb5Tx', '萌鸡小队：萌闯新世界', '//2img.hitv.com/preview/sp_images/2021/08/18/202108181227318473536.jpg', '动画,剧情', '冯操', '美佳妈妈,大宇,朵朵,欢欢,麦奇', '2021-10-01', 1, 'http://www.mgtv.com/b/435121/15800120.html?cxid=90f0zbamf', '一天，人类的挖掘机队伍进入森林，树木被砍伐，萌鸡们的家也被破坏了。美佳妈妈被迫带着萌鸡们上路，打算去“山的那边”寻找新家。但要到达“山的那边”并不容易，他们必须要穿过人类生活的城市。萌鸡们对城市中的一切都充满了好奇，但却不知道危险也正在向他们逼近……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('garkYxH3Qnj4Sh', '危城', '//i.gtimg.cn/qqlive/img/jpgcache/files/qqvideo/7/7vb9tgbdi71z914_x.jpg', '剧情,动作,犯罪', '陈木胜', '刘青云,古天乐,吴京,吴廷烨,姜皓文,廖启智,彭于晏,江疏影,洪天照,袁泉,释行宇,释彦能,孙蛟龙,李菁,马志威,罗浩铭,张竣杰,周天宝,王宇,张浩,王礴,尼利特龙,刘嘉艺,谢宁,萧兵,贺刚,王胜利,李华,龙德,顾建奕,李慧文,黄高虎,房旭士,吴常明,张特,韩由四夫,刘子玉,薛晓龙,杨司晨,高瑞,廖松梅,陶延梅,邹世中,张红军,李一山,甘智勤,杨春,沙庆丰,刘建强,王铁凌,刘挺,符毅明,周仲,张鹏,汪国辉,姜文平,张光超,周路,栗梅,张丹颜,苏拉文雅,杨杨,刘仕佳,张丰雅,李鹏,朱加镇,徐小明,刘小婉,屈刚,祁高坤,洪金宝', '2016-08-12', 1, 'http://www.mgtv.com/b/294230/3552639.html?cxid=90f0zbamf', '时值国家内战、军阀割据的乱世时代，军阀少帅曹少璘（古天乐 饰）因杀害三条人命，被普城保卫团团长杨克难（刘青云 饰) 绳之于法。可曹家财雄势大，以强权震慑居民，曹家上校张亦（吴京 饰）得悉事件后，赶来普城取人，在城中遇上多年不见师弟马锋（彭于晏 饰），马锋是位武功高强的浪人，路见不平欲拔刀相助，可是却面临正义与兄弟情之抉择。', 1, 5.7);
INSERT INTO `uni_video` VALUES ('gavlZRH6S0L0Th', '尼罗河上的惨案 普通话版', '//4img.mgtv.com/preview/sp_images/2022/04/22/202204221230407494243.jpg', '剧情,悬疑,犯罪', '肯尼思·布拉纳', '肯尼思·布拉纳,盖尔·加朵,艾米·汉莫,汤姆·巴特曼', '2022-02-19', 1, 'http://www.mgtv.com/b/443147/16047429.html?cxid=90f0zbamf', '作为阿加莎·克里斯蒂最为经典的小说之一，故事继续聚焦在上流社会的秘事，波洛在埃及度假期间，卷入到了一场危险的三角关系之中，他在察觉到这趟旅程中不寻常的味道之后，登上了那条驶往阴谋和死亡的船。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gKjjaUX6S0L8TR', '大海啸之鲨口逃生', '//p1.qhimg.com/t01a9439747fe36278c.jpg', '动作,恐怖,科幻', '金波·兰道', '沙妮·文森,泽维尔·塞缪尔,朱利安·麦克马洪,菲比·托金,戚玉武,释小龙,亚历克斯·罗素,林肯·刘易斯,沙维尔·塞缪尔,马丁·萨克斯', '2012-10-12', 1, 'http://www.letv.com/ptv/vplay/1826131.html', '宁静的澳洲海滩上，宿醉的救生员乔许（泽维尔·塞缪尔 Xavier Samuel 饰）让女友蒂娜（沙妮·文森 Sharni Vinson 饰）的哥哥罗利替他去海上例行检查防鲨网的设置，结果罗利遭到了鲨鱼的袭击，罗利的死对乔许和蒂娜造成了很大的心理阴影，乔许为此对女友充满了歉疚，乔许为此放弃了救生员的工作去超市做了理货员，蒂娜也远赴中国学习舞蹈。一年后，当蒂娜重新返回澳洲后，和乔许在超市不期而遇，与此同时，超市里风起云涌，偷窃、抢劫……就在这起突发事件白炽化的时候，地动天摇，海啸铺天盖地而来，超市立刻沦为孤岛，大鲨鱼随之而来，一场人鲨大战瞬间展开……', 1, 5.4);
INSERT INTO `uni_video` VALUES ('gKrlZBH3SHP2TB', '非凡任务', '//p0.qhimg.com/t0171e3494709ea568c.jpg', '剧情,动作,犯罪', '麦兆辉,潘耀明', '黄轩,段奕宏,郎月婷,祖峰,邢佳栋,王耀庆,王砚辉,丁勇岱,肖聪,李晓川,赵炳锐,代乐乐,陶海,赵铭岳,祖锋,郭紫铭,王熠,纪英贤,罗意淳,林家栋', '2017-03-31', 1, 'http://www.mgtv.com/b/309140/3939688.html?cxid=90f0zbamf', '林凯（黄轩 饰）是李建国（祖峰 饰）安插在贩毒集团的卧底，他逐步渗透到“双鹰”贩毒集团后，发现幕后头目“老鹰”（段奕宏 饰）与八年前李建国作为卧底调查的贩毒集团有关，还囚禁了当时李建国的上级，最终林凯与李建国巧妙配合捣毁了整个贩毒集团', 1, 6.3);
INSERT INTO `uni_video` VALUES ('gKToYRH6RnL4Th', '长津湖', '//i3.letvimg.com/lc04_isvrs/202112/30/11/00/ff70929d-7b4c-4d99-9fd1-6831b1b7808c.jpg', '剧情,历史,战争', '陈凯歌,徐克,林超贤', '吴京,易烊千玺,段奕宏,张涵予,朱亚文,李晨,韩东君,胡军,黄轩,欧豪,唐国强,刘沙,刘劲,王伍福,王健,周小斌,卢奇,吴铁梁,张笑君,吴卫东,周惠林,贺镪,赵永占,王洪涛,成国栋,林京来,褚栓忠,张一鸣,陆苇,田征,张宁江,林永健,刚毅,王燕阳,蔡心,孙渤洋,郭建,耿乐,王宁,李易泽,李岷城,杨一威,史彭元,郑恺,张国立', '2022-01-01', 1, 'http://www.mgtv.com/b/363286/15255617.html?cxid=90f0zbamf', '电影以抗美援朝战争第二次战役中的长津湖战役为背景，讲述了一段波澜壮阔的历史：71年前，中国人民志愿军赴朝作战，在极寒严酷环境下，东线作战部队凭着钢铁意志和英勇无畏的战斗精神一路追击，奋勇杀敌，扭转了战场态势，打出了军威国威。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gKviZBH6S0P4SB', '东北狙王决战虎牙山', '//m.ykimg.com/050E0000626A6CAE13F7FF09912E2A7B', '剧情,动作,战争', '于戈,陈绎森', '张钧涵,阚昕,柴园乐,孙艺真,刘威州,闫佳颖,赵迎利,田璐,龙武,毕超,陈玉勇,高海龙,程琪,郜玄铭,曹明华,王侃,宁小花,柴圆乐', '2022-05-15', 1, 'http://www.iqiyi.com/v_yw540pl8es.html?vfm=f_191_360y&fv=p_09_01', '影片讲述了“九一八事变”后，以狙击手任天行（张钧涵 饰）为代表的抗日志士在东三省沦陷之后，与凶残日寇展开殊死对决的枪战故事。任天行带领的抗日志愿军在一次伏击日军的夜战中全部阵亡，任天行重伤濒死被土匪救起，从此心灰意冷地过起了土匪的生活，直到伪装潜入山寨的白鸽（阚昕 饰）晓以民族大义将其唤醒。为救国救己，任天行与白鸽等人组成的抗日小分队合作，欲刺杀日军病毒专家，可行动之际计划被日军发现，众人该如何逃过重重追捕？任天行又为何亲手为自己立下墓碑？在任天行等人的秘密调查中，日军关于用村民做活体实验的巨大阴谋渐渐显露于世。正在此时，任天行收到了一封来自日本狙击手的“战书”，虎牙山硝烟四起，中日顶级狙击手将决一死战，众人的命运又将如何？', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gKXjaRH6RnjASh', '九条命', '//p0.qhimg.com/t012dc75b1f4bffa4ff.png', '战争,历史,剧情', '钱路劼', '宋禹,张立,郝星棋,张振华,张浩然,李幼斌,王挺,姜超,尹元章,沁坤,赵祖楠', '2020-11-13', 1, 'http://www.mgtv.com/b/333436/11093948.html?cxid=90f0zbamf', '1944年的抗日湘南战场上，在国民党向军队下达撤退命令后，有一群川军毅然留下选择坚守，这群川军在经过激烈的战斗后，最终只剩下以连长秦浩忠（宋禹饰）为首的9名士兵，在弹尽粮绝之际，为保护当地百姓，掩护群众撤退，他们与湘南瑶、汉乡亲一起，以自己的血肉之躯抵御外侮、抗击日本侵略者、捍卫尊严，最终牺牲在异地他乡。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gqLjYhH6RnX6UR', '奇迹·笨小孩', '//p0.qhimg.com/t01399c44aaab4d3b76.png', '剧情', '文牧野', '易烊千玺,田雨,齐溪,公磊,许君聪,王传君,章宇,张志坚,杨新鸣,陈哈琳,王宁,黄尧,巩金国,田壮壮,徐峥,咏梅,朱俊麟,贾弘逍', '2022-02-01', 1, 'http://www.mgtv.com/b/405778/15961434.html?cxid=90f0zbamf', '二十岁的景浩独自带着年幼的妹妹来到深圳生活，兄妹俩生活温馨却拮据。为了妹妹高昂的手术费，机缘巧合之下，景浩得到一个机会，本以为美好生活即将来临，却不料遭遇重创。在时间和金钱的双重压力下，毫无退路的景浩决定孤注一掷，而他陷入困境的平凡人生，又能否燃起希望的火花？', 1, 0.0);
INSERT INTO `uni_video` VALUES ('gqTjZ0H2RHj2Sh', '无法无天', '//img6.pplive.cn/2011/04/21/16394775580_230X306.jpg', '动作,犯罪,剧情', '沃迪·科蒂斯·霍尔', 'Tyrese Gibson,Shawn Parr,Henry Hunter Hall,保罗·泰瑞尔·科雷顿,汤米·阿伯特,梅根·古德,泰瑞斯·吉布森,William Duffy,Darris Love,拉伦兹·泰特,Game,DeWayne Turrentine,Ray Bengston,卡斯·莱蒙斯', '2006-04-28', 1, 'http://vip.1905.com/play/1547793.shtml?utm_source=360&utm_medium=cps&utm_campaign=1&__hz=ccb0989662211f61', '黑人“O2”（泰瑞斯•吉布森 Tyrese Gibson 饰）自小就是一名孤儿，生活在混乱的黑人底层社区，他最终也走上了犯罪的道路。刑满获释后，“O2”决定洗心革面，和儿子朱利安一起开始新的生活。然而天不从人愿，“O2”再次卷入了一起黑帮事件。原来，当地的黑帮抢劫了“O2”的车，而车上的朱利安也被一同劫走了。面对黑帮提出的巨额赎金，“O2”实在无力支付。为了救回儿子，“O2”找到了以前亲密无间的表弟，希望他能助自己一臂之力。没想到表弟却是个贪生怕死之徒，怎么也不肯出手相助。无奈之下，他只好找到了以前和他有过一夜情的妓女可可。可可老谋深算、胆识过人，十分同情“O2”的遭遇，于是，他们的拯救行动开始了！', 1, 6.2);
INSERT INTO `uni_video` VALUES ('gqXjZRH6S0P1SB', '夜舍', '//puui.qpic.cn/vcover_vt_pic/0/mzc002009x1f7dl1651288643640/0', '惊悚,恐怖', '大卫·布鲁克纳', '丽贝卡·豪尔,萨拉·古德伯格,沃迪·科蒂斯·霍尔,伊万·乔尼凯特,斯塔西·马汀', '2020-01-01', 1, 'http://www.mgtv.com/b/444135/16099064.html?cxid=90f0zbamf', '贝丝在先生欧文过世后，独自住在先生生前为她所建造的湖边小屋中，虽然她努力维持正常的生活，但噩梦仍朝她袭来，她感受到屋内似乎有一些不寻常的动静，而在朋友的建议下试图从先生的遗物中找寻答案，于是她决心解开这令人不安的秘密……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('hafrYxH5Rnj7Tx', '少年的你', '//p0.qhimg.com/t01725aeeeecb7eb734.jpg', '剧情,爱情,犯罪', '曾国祥', '周冬雨,易烊千玺,尹昉,黄觉,吴越,周也,张耀,张艺凡,赵润南,张歆怡', '2019-10-25', 1, 'http://www.mgtv.com/b/328217/7053545.html?cxid=90f0zbamf', '陈念（周冬雨 饰）是一名即将参加高考的高三学生，同校女生胡晓蝶（张艺凡 饰）的跳楼自杀让她的生活陷入了困顿之中。胡晓蝶死后，陈念遭到了以魏莱（周也 饰）为首的三人组的霸凌，魏莱虽然表面上看来是乖巧的优等生，实际上却心思毒辣，胡晓蝶的死和她有着千丝万缕的联系。\n一次偶然中，陈念邂逅了名为小北（易烊千玺 饰）的小混混，随着时间的推移，心心相惜的两人之间产生了真挚的感情。小北答应陈念在暗中保护她免受魏莱的欺凌，没想到这一决定引发了一连串的连锁反应。负责调查胡晓蝶死因的警官郑易（尹昉 饰）隐隐察觉到校园里的古怪气氛，可他的调查却屡屡遭到校方的阻挠。', 1, 8.4);
INSERT INTO `uni_video` VALUES ('haXkZBH6S0T0Th', '黄金蜘蛛城', '//m.ykimg.com/050E00006281B7E52037DD09087D8C04', '动作,惊悚,剧情,科幻', '代艺霖', '刘林城,陈孟奇,Sasha,宁小花,周杰,桑平,甄鹏宇,毛凡,王晓羽,王雷', '2022-05-21', 1, 'http://www.iqiyi.com/v_27ga7s278wk.html?vfm=f_191_360y&fv=p_09_01', '相传，地底万米深处有一座黄金城，入之即得到永生。思玛聪因为一本考古笔记，被富商襄爷盯上，要求思玛聪前往地下一万米深处寻找黄金城的下落。在探险途中，思玛聪遇到了一个从墓室圆棺中逃出的神秘青年，两人为了探索地底秘密而结盟。地底的巨大佛像、棺葬、异兽、菌类、还有万米深处的黄金蜘蛛城都即将揭开神秘的面纱。而此时，襄爷爆出了一个惊天秘密，这个神秘青年的竟然是思玛聪失踪多年的亲生父亲思玛辉…', 1, 0.0);
INSERT INTO `uni_video` VALUES ('hKPiZRH4QHP7Tx', '战狼2', '//p0.qhimg.com/t01cf5c3a769c367ee6.jpg', '动作,战争', '吴京', '吴京,弗兰克·格里罗,吴刚,张翰,卢靖姗,丁海峰,淳于珊珊,余男,于谦,石兆琪,海蒂·玛尼梅可,Oleg Aleksandrovich Prudius,阿隆·汤尼,Thayr Harris,勃小龙,奥列格·斯特里仁诺夫,苇青,杜建桥,Nwachukwu Kennedy,肯尼迪,海蒂·莫尼梅克,奥列格·普鲁迪乌斯,艾伦·托尼,赛尔·哈里斯,高明,王森,程愫,张永达,郭秋成,周冠廷,安·詹姆斯,黛安娜·希拉,孙率航,张馨月,关海龙,安妮塔·斯图尔特,特雷弗·琼斯,奥斯汀·普里斯特,克莱·方特诺特,保罗·艾力卡,丹尼尔·哈格里夫,李镇男,庄小龙,陈云志,希尔维斯塔·斯图尔特,喜利图,宋歌', '2017-07-27', 1, 'http://www.mgtv.com/b/297817/4050151.html?cxid=90f0zbamf', '由于一怒杀害了强拆牺牲战友房子的恶霸，屡立功勋的冷锋（吴京 饰）受到军事法庭的判决。在押期间，亲密爱人龙小云壮烈牺牲。出狱后，冷锋辗转来到非洲，他辗转各地，只为寻找杀害小云的凶手。在此期间，冷锋逗留的国家发生叛乱，叛徒红巾军大开杀戒，血流成河。中国派出海军执行撤侨任务，期间冷锋得知有一位陈博士被困在五十五公里外的医院，而叛军则试图抓住这位博士。而从另一位华侨（于谦 饰）口中得知，杀害小云的凶手正待在这个国家。\r\n在无法得到海军支援的情况下，冷锋只身闯入硝烟四起的战场。不屈不挠的战狼，与冷酷无情的敌人展开悬殊之战……', 1, 7.1);
INSERT INTO `uni_video` VALUES ('hKvjYhH4RHX3Sh', '红海行动', '//p0.qhimg.com/t014e821298dacb9dd4.jpg', '动作,战争', '林超贤', '张译,黄景瑜,海清,杜江,蒋璐霞,张涵予,尹昉,王强,郭家豪,王雨甜,麦亨利,王彦霖,郭郁滨,霍思燕,任达华,于大伟,黄芬芬,蔡洁,周杰伦', '2018-02-16', 1, 'http://www.mgtv.com/b/315515/4370768.html?cxid=90f0zbamf', '中东国家伊维亚共和国发生政变，武装冲突不断升级。刚刚在索马里执行完解救人质任务的海军护卫舰临沂号，受命前往伊维亚执行撤侨任务。舰长高云（张涵予 饰）派出杨锐（张译 饰）率领的蛟龙突击队登陆战区，护送华侨安全撤离。谁知恐怖组织扎卡却将撤侨部队逼入交火区，一场激烈的战斗在所难免。与此同时，法籍华人记者夏楠（海清 饰）正在伊维亚追查威廉·柏森博士贩卖核原料的事实，而扎卡则突袭柏森博士所在的公司，意图抢走核原料。混战中，一名隶属柏森博士公司的中国员工成为人质。为了解救该人质，八名蛟龙队员必须潜入有150名恐怖分子的聚集点，他们用自己的信念和鲜血铸成中国军人顽强不屈的丰碑！\n本片根据也门撤侨事件改编。', 1, 8.3);
INSERT INTO `uni_video` VALUES ('hqblZxH6S0LATx', '开棺', '//m.ykimg.com/050E00006269F4F313EB660968A69FF5', '惊悚,犯罪,悬疑', '成思毅', '韩栋,钟雷,姜超,周晓鸥,何中华,佟磊,张继南,朱海军,周斌,王禛,李若希,岳冬峰,王铂清,许敏,徐小琴,周洛伊,张霸波,李高吉', '2022-05-02', 1, 'http://v.youku.com/v_show/id_XNTg1Mzc4MjQ4OA==.html?tpa=dW5pb25faWQ9MTAyMjEzXzEwMDAwN18wMV8wMQ&from=360sousuo&refer=360sousuo', '消失三年的“鬼手”及其盗墓团伙重现江城，再次堪舆点穴下墓摸金。怎料，四名盗墓贼在开棺之时遭遇惊魂邪煞，逃离墓葬之后又接连惨死家中。古墓“尸毒”和命宫印堂之上的分魂针孔，成为留给警察沈春合仅有的查案线索。看似普通的盗墓案，瞬间扑朔迷离，疑点重重。四人是盗墓太多自食报应丧命，还是分魂针所指的换命转病，遭人蓄意谋杀？盗墓掌眼“鬼手”的神秘身份，更是牵出陈年谋杀警察旧案。沈春合联手法医韩冰，解刨验尸身、下墓取尸毒、棺材店中破邪术、纸扎店里缉真凶。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('hqfiYxH6QXX2Sh', '金刚川', '//i1.letvimg.com/lc01_isvrs/202012/07/14/16/0738c3fd-0ba4-415b-9d85-aea098a62d6f.jpg', '战争,剧情,动作', '管虎,郭帆,路阳', '张译,吴京,李九霄,魏晨,邓超,欧豪,邱天,周思羽,杜江,张承,刘显达,杨轶,齐超,朱梓瑜,刘雨辰,万沛鑫,石昊正', '2020-10-23', 1, 'http://www.mgtv.com/b/347411/10514686.html?cxid=90f0zbamf', '1953年，抗美援朝战争进入最终阶段，志愿军在金城发动了最后一场大型战役。为在指定时间到达，向 金城前线投放更多战力，志愿军战士们在物资匮乏、武装悬殊的情况下，不断抵御敌机狂轰滥炸，以血肉 之躯一次次修补战火中的木桥。一段鲜为人知的历史，在暗流涌动的金刚川上徐徐展开......', 1, 0.0);
INSERT INTO `uni_video` VALUES ('hqfnZRH6R0T0TB', '送你一朵小红花', '//p0.qhimg.com/t0106d84421f379fd9f.png', '剧情,爱情', '韩延', '易烊千玺,刘浩存,朱媛媛,高亚麟,夏雨,岳云鹏,陈祉希,李晓川,乐儿,安笑歌,黄凯璐,高卫兵,孔琳,姚未平,张绍刚,孙强,吴晓亮,张浩天,柴陆', '2020-12-31', 1, 'http://www.mgtv.com/b/348435/11255339.html?cxid=90f0zbamf', '两个抗癌家庭，两组生活轨迹。影片讲述了一个温情的现实故事，思考和直面了每一个普通人都会面临的终极问题——想象死亡随时可能到来，我们唯一要做的就是爱和珍惜。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('O0Xmap7lLoSuDz', '超级小熊布迷 第二季', '//puui.qpic.cn/vcover_vt_pic/0/4c31hfzlzwglswx1538993937/0', '少儿,剧情,冒险', '赖嘉晟', '未知', '全52集', 4, '', '在《超级小熊布迷》新一季的故事里，巴戈大魔王穿过星星世界的漏洞进入到互联网，喜欢制造麻烦的他入侵到互联网里的各种节点（空间），扰乱秩序，破坏规则，把一切搞得一团糟，并以此为乐，比如他会入侵到一个主题是古埃及的游戏世界里，派一个邪恶又自恋的大祭司抢夺法老的法宝，并把这个游戏世界里的所有人都变成木乃伊；他还会入侵到智能餐厅的电脑系统中，在制作食物的过程中加入各种奇怪的食材和佐料，让做出来的食物成为黑暗料理；他还会入侵到共享单车的控制系统中，导致单车失去控制，或者反向行驶、或者跳来跳去、或者变成独轮车等等，让骑行的人们窘态百出。由于互联网与现实世界紧密相连，巴戈大魔王的破坏行为也给现实生活造成了各种各样的问题。于是布迷和朋友们通过“星星之门”进入被巴戈大魔王入侵的网络虚拟空间里，这些虚拟空间都有各自的世界观和规则，布迷他们也会根据所处的虚拟空间的不同而拥有不同的身份和能力，他们和巴戈大魔王斗智斗勇，通过解决巴戈大魔王设定的重重障碍和陷阱，最后战胜巴戈大魔王，同时解决现实生活中的问题。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('OkDncJ7mMIz0CT', '我，伊蒂丝女皇', '//3img.mgtv.com/preview/sp_images/2021/09/22/202109221111257922578.jpg', '魔幻,热血,励志', '未知', '未知', '全22集', 4, '', '高中生顾云云穿越醒来发现自己变成了一个叫伊蒂丝的一岁女皇，坐拥庞大的帝国外，还是一个被神明祝福的孩子。可这幼年皇帝不好当，国家表面繁荣实则已经摇摇欲坠，自己的小命也被一个神秘教会惦记。布满荆棘的女皇之路上，一个叫克洛洛的孩子来到她的身边，而他的灵魂似乎也不简单。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('OkDsb57kLIWxED', '猫和老鼠', '//2img.mgtv.com/preview/internettv/sp_images/ott/2016/dongman/294264/20160623174527094-new_220x308.jpg', '搞笑', '威廉·汉纳,约瑟夫·巴伯拉', '猫和老鼠', '全185集', 4, '', '《猫和老鼠》的故事情节围绕着一对常见的家猫汤姆和老鼠杰瑞而展开，汤姆有一种强烈的欲望，总是不断努力的去捉同居一室的老鼠杰利，并不断地努力驱赶着这位讨厌的房客。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('OkLnbZ7mMISuCT', '精灵梦叶罗丽 第九季', '//3img.mgtv.com/preview/sp_images/2021/12/31/202112311535202708764.jpg', '魔幻,冒险,热血', '金今', '魏茹晨,金琪,郝祥海,李诗萌,山新,藤新,凌飞,陈洁怡,小连杀,张幽舞,佟心竹,阎萌萌,楚越', '全26集', 4, '', '世界会变成什么样？灵犀阁最后一位阁主到底是谁？被释放的火领主会做什么？灵犀阁会怎么样？女王和黎灰会得到灵犀之力吗，时希封印解除，辛灵冰公主会回来吗？', 1, 0.0);
INSERT INTO `uni_video` VALUES ('OU4mbJ7mLI3uCD', '奥特银河格斗 巨大阴谋中配版', '//r1.ykimg.com/050E00005FB7883E2027EE082C892A95', '真人,格斗,科幻,热血', '未知', '未知', '全10集', 4, '', '本不可能存在的神秘凶恶怪兽·宇宙人们来袭了！赛罗、利布特、泰迦、泽塔、爱迪、麦克斯、梦比优斯、葛雷、帕瓦特、格丽乔......还有更多的奥特英雄将共同加入战斗，向震撼全宇宙的令人费解的事件发起挑战。然而这一切，只不过是从现在开始的大乱斗的序章而已！开始浮现的阴谋，交错的故事。暗中活动的黄金巨人的目的究竟是什么？与“泽塔奥特曼”的故事相联结，新的奥特历史开始了！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('OUPrbp7kNIKuCT', '熊出没之探险日记', '//puui.qpic.cn/vcover_vt_pic/0/wze0f9voi6x1r9s1511754260/0', '搞笑,冒险,益智', '丁亮', '熊大,熊二,光头强', '全52集', 4, '', '讲述了在夏季休林季，光头强变身成为一名导游，并与熊大熊二一起，帮助小女孩赵琳去往森林深处找寻儿时玩伴东北虎的故事。在寻虎的探险路上，他们走过美丽神秘的森林、奇妙的地下世界、缤纷的雪山世界……他们不仅面临自然生存的考验，还要与盗猎者反派斗智斗勇、拯救动物、帮助有困难的当地人，一场欢乐的奇妙探险由此开启……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('OUTpbp7mMIauDD', '汪汪队立大功 第八季', '//4img.mgtv.com/preview/sp_images/2022/01/24/202201241637433108192.jpg', '冒险', 'Jamie Whitney', '灰灰,毛毛,天天,阿奇,莱德', '全25集', 4, '', '这部美国学龄前儿童教育动画片，讲述男孩Ryder带领的一个狗狗救援队的精彩故事。可以让孩子们在欣赏动画的同时，学习一些基础的安全和救援知识。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('P0frbZ7lMoK3CD', '某天成为王的女儿', '//3img.mgtv.com/preview/internettv/sp_images/ott/2019/12/3/dongman/334821/20191203190937549-new.jpg', '魔幻', '未知', '浅浅', '全120集', 4, '', '一场车祸让她穿越到魔法世界，一次比赛又让她被皇帝收养成为了公主。只是，人家的公主都是锦衣玉食仆人千万小日子过的贼开心。为什么轮到她，就只能住在破旧小柴房每日非打即骂？不行，她要反击！而当看到她反击的模样，某个冰块脸皇帝嘴角微微勾勒道：“这个小家伙，有点意思。”', 1, 0.0);
INSERT INTO `uni_video` VALUES ('P0LoaZ7lLoSxDz', '迷你特工队X', '//pic8.iqiyipic.com/image/20181012/86/90/a_100198780_m_601_m1_195_260.jpg', '4岁,5岁,少儿,励志,战斗', '施忠', '三智', '全52集', 4, '', '\"在浩瀚的宇宙中，经过长期岁月辗转，被秘密选召出的四个小动物，作为“迷你特工队”保护地球的和平，他们是最强战士：弗特、塞米、露西、麦克斯！数百年后宇宙海盗丹丹团三人组——卡拉、丹特、丹乔，在某个小行星发现了被封印的外星人杰苏，并解开封印让其重见天日。杰苏的力量源于生命体所散发出的负面情感（恐惧、伤心），被称作不幸能量。这伙邪恶势力筹划在地球不断制造危机，并从地球上的生命体获得不幸能量。迷你特工队为保护地球，与邪恶势力展开了激烈的战斗！\"', 1, 0.0);
INSERT INTO `uni_video` VALUES ('P0LobZ7jMIOwET', '爱探险的朵拉 第八季', '//s.wasu.tv/mrms/manage/images/201504/30/554182e6b7ed1.jpg', '经典,儿童,早教,冒险', 'Chris Gifford,Valerie Walsh,Eric Weiner', '朵拉,爸爸,地图,Boots,背包,迪亚哥,布茨', '全20集', 4, '', '一个留着棕褐色短发、穿着粉红色外衣、背着紫色小书包的小女孩精灵活现地跳跃在你的面前，脸上带着活泼的笑容，她将是带领孩子走进启蒙乐园的小导游,更是孩子们熟悉的小伙伴——朵拉。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Pbdwan7lTG8pN3', '暗夜行者', '//pic9.iqiyipic.com/image/20220519/ab/09/a_100459594_m_601_m5_195_260.jpg', '悬疑,警匪,谍战', '方婷婷', '李易峰,宋轶,冯德伦,宫海滨,古斌,宋奕星,郭东文,常仕欣,王挺,安子杨,李祉默,宿北宸,石兆琪,赵子琪,连凯,高冬平,王策', '更新至14集', 2, '', '该剧讲述背负秘密的警方线人陈陌，为获取情报潜入东南亚最大毒枭组织，在追查真相与面对自身命运的路上冲破黑暗的故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PbJraX7lTG4sM3', '请叫我总监', '//m.ykimg.com/050E0000616FACBF13F7FF0980EF9607', '言情,都市', '姚婷婷', '林更新,谭松韵,刘畅,苏鑫,王秀竹,白冰,龚蓓苾,王丽娜,刘恩佳,曲高位,张磊,袁满,常海波', '更新至32集', 2, '', '宁檬一直有一个成为投资总监的职业梦想，可毕业后做的工作却与梦想相距甚远。她的上司陆既明是一个业务能力极强的投资总裁，他不认为宁檬也能成为合格的投资人。某一天宁檬终于下定决心离开陆既明，向他也向自己证明她可以做到。宁檬重新求职，经过种种阻碍，机缘下最终进入了鹰石投资，开始了她的晋升之路。过程中陆既明也在关注着宁檬，起初他不认可，但在重要关头还是会对宁檬进行提点，帮助她渡过难关。陆既明长远的投资理念使宁檬获益匪浅，宁檬也改变了陆既明的处世态度。两人互相影响，携手并进，经历了无数的波折和风浪之后，宁檬蜕变成为了独当一面的金牌投资人，陆既明也历练得更加成熟有担当。他们认定彼此就是自己最正确的那个人。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PbJrc07lTG8oNn', '凭栏一片风云起', '//3img.mgtv.com/preview/internettv/sp_images/ott/2022/5/18/dianshiju/389675/20220518175935987-new.jpg', '剧情,军事,历史', '金琛', '胡一天,章若楠,王劲松,张晞临,张赫,林子璐,高伟光,刘珈彤,张钰琦,李岷城,胡亚捷,王思懿', '更新至23集', 2, '', '剧集聚焦1937-1945年国难时期，讲述北平的三个知识分子家庭的两代人，面对时代的大动荡和大变局，做出的选择和牺牲。有人选择守护中华文化，赓续文化血脉；有人选择投笔从戎，枪杆救国。他们允文允武，百折不挠，是理想主义者，更是现实行动派。他们竭力救亡图存，积极探寻国家出路，最终走向光明。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PblpaX7lTG4rNX', '重生之门', '//m.ykimg.com/050E00006268A32A13EB660968CDA913', '悬疑,警匪', '杨冬', '张译,王俊凯,冯文娟,范诗然,徐悦,兰海蒙,田小洁,尹铸胜,潘粤明,张国强,江柏萱,徐洁儿,曹克难,刘岳,赵秦,刘显达', '更新至26集', 2, '', '该剧讲述了刑侦队长罗坚在调查古画失窃案件的过程中结识了天才大学生庄文杰，两人联手屡破奇案的故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PbNoaqPZRmDnM3', '中国地', '//p0.qhimg.com/t01d54277b82de8e796.png', '伦理', '阎建钢', '李幼斌,萨日娜,刘交心,石天琦,李金哲,李大强,秦焰,王雨', '更新至40集', 2, '', '该剧讲述了“九一八”事变后，今辽宁省朝阳市清风岭地区的汉子“赵老嘎”，带领全家、全村以及后来投奔而来的人民，浴血奋战，后来在中国共产党的关注和支持下，固守清风岭坚持14年之久未让日军占领的抗日传奇故事。李幼斌饰演剧中灵魂人物“赵老嘎”，携手荧屏伴侣萨日娜共同演绎了一对传奇的中国英雄夫妻，他...', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PbNtaX7lTG4qMn', '摧毁', '//i3.letvimg.com/lc04_isvrs/202204/15/16/32/f2f7d060-73e0-48ed-8030-7a00c2c67632.jpg', '谍战,剧情', '金曙', '傅浤鸣,张澎澎,杜源,宁晓志,施展,王晓,王长林,敖杨,赵丹,黄河,杨鹤云,王春宇,姜志刚,王政,唐菱,滕爱弦,孙布尔,王斯琼,曹丞,白雪,张雨霏,沈璐,徐洪浩,夏侯镔,赵荀,张进,周惠林,傅程鹏,沈璐（演员）,施展 （演员）,张萍娟', '更新至40集', 2, '', '抗战时期，国军连长方梦凯阻击日寇立功，他的兵痞上司却以临阵脱逃罪要抓他上军事法庭，危难之际方梦凯遵从父命远赴香港避难。四年后即将学成的方梦凯因得罪黑社会而遭疯狂追杀，幸得恩师宋吉刚搭救才免遭杀戮，无奈两人只好回故乡海州投奔方父。随后发生的一桩桩事使他预感自己中了圈套，透过重重迷雾他终于查明真相。国民党为掩护大批官员和精锐溃退台湾，准备炸毁山上的水库大坝，以切断和阻挡解放大军前进的步伐。为掩人耳目，他们选定方父的棉麻仓库囤积炸药。宋吉刚、罗文昌等人为得到图纸用尽各种手段并残忍地杀害了方敬斋。面对亲人惨遭不幸，方梦凯原有的信仰被彻底摧毁。在恋人罗丹的感召下，他投奔了共产党并说服警备副司令罗子健率部起义，历经磨难的方梦凯最终成长为一个坚强的革命者。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PEbnaZ7lNYa2CD', '阿巳与小铃铛', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200bznlvdt1604556229963/0', '治愈,轻松', '俞爱健', '未知', '全300集', 4, '', '《阿巳与小铃铛》是一部原创国产3D动画，男主阿巳是一个法力高强妖，本体为一条巴蛇。女主小铃铛则是一个人类少女。阿巳和小铃铛在一次争吵之后去寺中寻师父开解，就此与一禅小和尚和师父相识，三人自此之后成为朋友，每日打打闹闹，嬉戏游乐，讲述了一个个可爱又让人忍俊不禁的小故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PEbqbZ7mMoCzCz', '间谍过家家', '//pic3.iqiyipic.com/image/20220424/13/6e/a_100503264_m_601_m4_195_260.jpg', '动作,搞笑', '古桥一浩', '江口拓也,种崎敦美,早见沙织,吉野裕行,甲斐田裕子', '全1集', 4, '', '这是一个世界各国均暗地里进行激烈情报战的时代。东国（Ostania）与西国（Westalis）的冷战状态已经持续数十年。“黄昏”是西国情报局东国对策科“WISE”的一名优秀间谍。为调查威胁东西两国和平的人物——东国国家统一党总裁多诺万·德斯蒙，上级给予了他一个绝密任务。任务名为：“枭”（Strix）行动。内容是“一周之内组建家庭，潜入德斯蒙儿子就读的名门学校的联谊会”。于是“黄昏”扮演成精神科医生劳埃德·福杰，开始组建家庭。然而，他找来的女儿阿尼亚是个能读心的超能力者，妻子约尔是个杀手！三人利害关系一致，便互相隐瞒身份，开始了共同生活。世界的和平，就掌握在这意外不断的临时一家人手中。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PEDscJ7lMoC0Cj', '开心锤锤', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200dwnknik1573030109/0', '搞笑', '未知', '锤锤', '全800集', 4, '', '主人公锤锤是一个普普通通的年轻人乐观善良，有梦想，围绕他展开了一系列啼笑皆非的故事。以动画为载体，通过轻松幽默的搞笑方式演绎日常生活中发生的小故事，从而引发观众共鸣，传递正能量，深受粉丝的喜爱。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PkboaZ7mL4SwCD', '特利迦奥特曼', '//pic7.iqiyipic.com/image/20210708/61/07/a_100466886_m_601_m1_195_260.jpg', '热血,奥特曼', '坂本浩一', '寺坂赖我,丰田留妃,金子隼也,水野直,春川芽生', '全29集', 4, '', '跨越时空苏醒的光之巨人特利迦奥特曼，苏醒了！3000万年前，一股黑暗力量使世界陷入恐惧。最后是光之巨人将黑暗封印到了遥远的宇宙中。不过，光之巨人也用尽了自己的力量，在红色星球上陷入了长眠。时光流转，地球和平同盟“TPU”在地球组建了精英小组“精英胜利队”。主人公真中剑悟生活在新开拓的火星上，他有一个梦想，就是守护大家的笑容。剑悟平日里在植物研究中心工作，他是名植物学家。最近他总是重复做一个恶梦，梦里总出现一名神秘的巨人，这让他十分苦恼。有一天，超古代封印的黑暗突然再次来袭，打破了火星安稳宁静的生活。当火星的街道被怪物破坏时，剑悟在命运的引导下，和沉睡的光之巨人相遇了。这次相遇会给他和地球带来怎样的影响呢？', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PkDqap7mL4z3Cj', '小猪佩奇 第八季', '//pic1.iqiyipic.com/image/20210804/ec/5e/a_100470203_m_601_m1_195_260.jpg', '幼教,益智,亲子,搞笑', '阿斯特利', '小猪佩奇', '全45集', 4, '', '《小猪佩奇》是一部针对学龄前儿童的动画片，讲述的是一只名叫佩奇的可爱小猪的故事。四岁的佩奇和她的妈妈、爸爸以及弟弟乔治生活在一起。动画中以有趣的方式展示了小朋友的各种生活初体验，不论是去看牙医、学习制作蛋糕、还是外出度假等，都可以帮助小朋友学习并度过他们自己人生的初次体验。每集5分钟，围绕佩奇每天的趣事和积极的家庭价值观展开，非常贴近生活，让小朋友和家长感受到和家人及朋友相处的快乐时光。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Pkfoap7lNYSzDT', '捷德奥特曼 剧场版：连接吧！心愿！！', '//r1.ykimg.com/050E00005F719A0A14187C07C99F2821', '真人,竞技,冒险,动作,科幻,动画', '坂本浩一', '滨田龙臣,山本千寻,长谷川真优,小泽雄太,本仮屋唯佳,青柳尊哉,石黑英雄,小西克幸,三森铃子,潘惠美,浅沼晋太郎,宫野真守,绿川光,神谷浩史,关智一,入野自由,田中秀幸,池田昌子,西冈德马', '全1集', 4, 'http://www.mgtv.com/b/440839/16041059.html?cxid=90f0zbamf', '在试图杀死整个宇宙的知识生活的无垠的敌人击退勇士超的力量，甚至是光，幸存下来的严酷命运基德奥特曼面对！地球的危机消退和数据缩减，欧布奥特曼，伽古拉和赛罗奥特曼现身！而Riku的热门感觉唤醒了基德进入终极形式的终极决赛！最强的武器·Giga终结者提高节拍！它继续摧毁星采用智能化的生活居住着巨大的人工智能Girubarisu和，Gyaraku特隆兵团是一个全球性的办法。基德奥特曼朝仓陆，Girubarisu“红钢”来到地球，并从伽古拉那听到的，它是有线索的南大洋去了天堂·冲绳。会在冲绳岛相见吧，你看通过朝仓陆是基德奥特曼，面对Takuso一个重大使命。在朝仓陆的面前说Kiou超过必要保护地球红凯欧布奥特曼的出现，是把他作为前辈。在另一方面，攻击冲绳Gyaraku特隆军团开始寻求“深红钢”。基德，欧布，和赛罗奥特曼也去了地球。而要坚持自己的使命，不耐烦基德的行为，是导致在美国奥特曼进一步危机。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PkHkap7mLoaxCT', '快穿系统：偏执BOSS不好惹', '//4img.mgtv.com/preview/sp_images/2021/07/06/202107060943114947139.jpg', '恋爱,魔幻', '蛤蜊', '未知', '全30集', 4, '', '三千位面管理者女主神绫清玄意外死亡，为了寻回生命和记忆，把小黑莲男主染回小白莲，女主神用她的实际行动告诉围绕在男主身边的飞蛾们：无论哪个世界，我都是永远的神！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PkLtap7kMICvCj', '汪汪队立大功全集', '//pic6.qiyipic.com/image/20170124/35/8a/a_100042795_m_601_195_260.jpg', '宠物,冒险', 'Jamie Whitney', 'Ryder,Marshall,Rubble', '全300集', 4, '', '精通科技的10岁男孩Ryder在拯救了6条小狗之后，将他们训练成了一组本领高强的狗狗巡逻队。每个小狗都性格鲜明，也各有特长。斑点狗Marshall擅长火中急救；斗牛犬Rubble精通工程机械；牧羊犬Chase是个超级特工；混血儿Rocky是个维修能手；拉布拉多犬Zuma最熟悉水中救援；而可卡颇犬Skye掌握着各种航空技术。拥有这么多解决问题的能力，在加上Ryder提供的炫酷装备支持，不管遇到多么困难和危险的救援任务，他们还总是忘不了相互玩闹，制作轻松的气氛，而每次幽默乐观的狗狗能总能顺利完成任务。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PkPmasHbYo3uED', '戴拿奥特曼', '//p0.qhimg.com/t010812f9b78b1b7fb8.jpg', '动作,幻想,真人', '平成', '飞鸟信,奥特曼,鹤野刚士,布川敏和,加濑尊朗,小野寺丈,山田玛利亚,齐藤理纱,木之元亮,齐藤理沙,长野博,片桐入,河崎实,堀内正美,板谷祐三子,清水綋治,寺田农,鸫,宫坂广,高树澪', '全51集', 4, '', '迪迦离开后的第8年，即2017年，主人公飞鸟信的父亲飞鸟一马，是在光中消失的宇航飞行员。当时的飞鸟还和他的父亲约定回来看他打棒球，在此时他却从戴民长官那里得知了噩耗。飞鸟长大后，加入了地球和平联合组织TPC，在一次模拟战争中一举击败了SUPER GUTS的王牌飞行员由美村良，然而此时他却遇到了宇宙球体“斯菲亚”，虽然他奋力战斗，却寡不敌众。此时他看见了神秘的光，成为了继大古后的第二个光之巨人人间体。当飞鸟清醒过来时，他已经莫名其妙地成为了SUPER GUTS的队员了，是由美举荐了他。\r\n在火星的一次战斗中，斯菲亚与岩石合体，变成了怪兽。飞鸟在和它的战斗时，身陷险境，此时他的身体发出闪亮的光。这时，他变成了新的光之巨人。巨人以压倒的优势击败了敌人。当飞鸟恢复回原来的样子时，他的脚边出现了神秘的变身器——里夫拉舍变身器。在之后，SUPER GUTS的女队员绿川麻衣给这个新奥特曼命名为“戴拿·奥特曼”，于是，新的光之巨人传说开始了。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PLdran7lTzXpNX', '我们好好在一起', '//p0.qhimg.com/t01f99824dc860f135e.png', '都市', '习辛', '刘之冰,茹萍,王丽云,赵恒煊,张立君,王晓梅,刘希媛,戴娇倩,邓皓,柯子静,卢毅,杨猛,杜鹤,金子,刘冰玥,王颢桦,卢誉文', '更新至36集', 2, '', '韩桂茹在插队时与安国庆相恋，后被其无情抛弃，从而跳河自杀。命是救回来了，但是终身不能再生育。四十年后，韩桂茹在户外排练时中暑，被闺蜜吴英送至附近的“夕阳红乐园”休息。二人发现“夕阳红乐园”的老板正是安国庆。如今的安国庆虽然实现了年轻时的理想抱负，却尝尽了“众叛亲离”的滋味。安国庆现在的心愿有三，一是弥补韩桂茹的痛苦，二是求得老友许慕的原谅，三是找到自己失散的女儿。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PLhoan7lTG4tMH', '良辰好景知几何', '//m.ykimg.com/050E0000626514431FD8520920A518E6', '言情,历史', '钟澍佳', '窦骁,陈都灵,胡军,王劲松,袁昊,赵樱子,赖艺,董璇,关芯,冉旭,何明翰,刘萌萌,姚安濂,张弓', '更新至43集', 2, '', '本剧讲述了民国初年，将门之子萧北辰对落魄千金林杭景一见倾心，后历经几重波折，为爱蜕变，成长为少年将领的故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PLNtbn7lTG0lNX', '没有工作的一年', '//1img.mgtv.com/preview/sp_images/2022/04/06/202204061901068515956.jpg', '剧情,都市,芒果出品', '郭增友', '辣目洋子,万鹏,翟子路,李俊贤,蒋雪鸣,朱锐,李彦漫', '更新至16集', 2, '', '何雨因不满上司灰色操作惨遭“被离职”，被迫跟同名同姓的青年小雨住到了同一屋檐下。在没有工作的一年中，两个理念迥异的女孩互相依靠，互相改变，抛弃打鸡血的生活方式，找到了内心的平静。两人从对方身上领悟到生活和工作的意义。不够“成功”，也可以很幸福。屡战屡败的人生，也怀有希望。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PLRvan7lSWXnMn', '跨过鸭绿江', '//p1.img.cctvpic.com/fmspic/vms/image/1609048038700.jpg', '军事', '董亚春', '唐国强,丁勇岱,刘之冰,王挺,王九胜,卢奇,孙维民,姚刚,张笑君,何政军,王同辉,王志飞', '更新至40集', 2, '', '《跨过鸭绿江》全景展现了抗美援朝从最初决策到最后签订停战协议的整个过程，热情讴歌英雄儿女，弘扬伟大的抗美援朝精神。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Prhxan7lTG8lM3', '女士的法则', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200moikwsy1651743749513/0', '都市,言情,剧情', '李江明', '江疏影,刘敏涛,彭昱畅,高鑫,戴向宇,高曙光,师铭泽,赵奕欢,徐立', '更新至22集', 2, '', '女律师许婕因为在原本的城市遭遇情感及事业受挫，便受明堂事务所合伙人李功明之邀来到明堂，成为事务所的实习律师。许婕来明堂的主要任务是替李功明查清律所另外一个合伙人陈文光的受贿案，同时她也需要在全新的环境下重新开始。许婕被分配到风雨飘摇的二组，与陈染成为同事，而陈染正是陈文光的女儿。在许婕来到事务所后，两个秉承着不同理念的律师，逐渐从相识到相知。随着一桩桩委托案的圆满解决，两人互为知己彼此信任。调查不断深入、律所意外频频爆发，使得两人的命运被牢牢捆绑在一起。同时，许婕和陈染在磨合中也成为了彼此工作与生活上不可或缺的一部分……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PrRtcH7lTG8sMH', '警察荣誉', '//pic0.iqiyipic.com/image/20220524/ea/a4/a_100458464_m_601_m2_195_260.jpg', '家庭剧,自制,剧情,都市,警匪', '丁黑', '张若昀,白鹿,王景春,宁理,徐开骋,赵阳,曹璐,王同辉,李晓川,齐襄,齐奎,李诚儒,许娣,吴玉芳,刘威葳,刘仪伟,郭虹', '更新至10集', 2, '', '八里河派出所两代民警在一次次出警办案中得到磨炼成长，传承警魂共同守护警察荣誉。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PrZsaX7kRWHnNn', '镖门', '//photocdn.sohu.com/20141222/vrsa_ver8357004.jpg', '历史,言情', '黄伟,韩晓军', '霍建华,倪大红,王庆祥,刘一含,李健,贾青,杨烁,郭晓峰,党昊,康凯,倪大宏,贾清,党浩予,尹铸胜,程皓枫,陈牧扬,周奇奇,于彦凯,董玥,冯伟力,马维福,韩朔,时光,刘端端,汪洋', '更新至38集', 2, '', '清末民初，时局混乱，山西太谷镖局总镖头戴老爷子凭借一身形意拳打下致远镖局的金字招牌。入室大弟子刘安顺办事沉稳为人仗义，深得戴老赏识，不仅将总镖头位子传给他，更令膝下爱女戴戎与他缔结婚约。不想刘安顺因恪守规矩逼死了走镖失利的镖师马奎，又因土匪山猫勾结内奸致使走镖失利。为服众亦为“规矩”，刘安顺只身北上京城，凭借一身硬功夫在京城镖局立稳脚根，开创了新镖路。面对未婚妻和师弟的背叛，他坚强面对，女土匪路瑶婷对他的爱意却让他不敢承受。当他们终于能抛开世俗，互许终身之时，路瑶婷为救刘安顺命殒黄泉。至亲的母亲、师傅戴海臣也都先后惨死在战乱和小人之手，国恨家仇交织在一起，引出一段镖门传奇与挽歌。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PrZtcH7lTG8pMn', '一夜新娘 第二季', '//0img.mgtv.com/preview/sp_images/2020/10/23/20201023163126327.jpg', '芒果出品,古装,网剧,偶像', '任海涛', '袁昊,赵昭仪,王泽轩,毛娜,关芯,余凯宁,黄千硕,赵文龙', '更新至14集', 2, '', '花溶与秦尚城历尽劫波、终成爱侣。正当两人婚礼，一纸圣诏却命花溶与邻国质子合亲，为保全天下，花溶决定与秦尚城暂时“隐婚”，一同率领天楚使团出使南荒“和亲”。一路上，岛主夫妇“地下恋”撒糖，“情敌”端木白狂拆CP，张弦、钱大有爆笑护送，原班人马开启了一段新的妙趣横生又凶险万分的江湖大冒险。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PU4kaZ7mMYKzDT', '巴啦啦小魔仙之魔法星缘堡', '//i1.letvimg.com/lc07_isvrs/202204/21/11/35/2637a054-d690-45f4-a9c7-f41d3f7a7366.jpg', '美少女,童话,奇幻,励志', '江志安', '娜希雅,凌海昕,夏凡', '全26集', 4, '', '星缘奇境是一座浮空岛，中央的星缘堡顶端围绕着具有强大魔法能量的三颗星石，是少女们美好生活的象征。觊觎星石力量的黑魔仙，伺机抢夺，却意外使星石碎裂散落。三只守护星石的穿梭精灵来到人类世界，命运般的邂逅了三个少女。少女的爱心和勇气唤醒了巴啦啦能量，她们在穿梭精灵的陪伴下，不断成长，寻找星瓣，合成星石。个性迥异她们互相支持，最终收获友谊成为真正的巴啦啦小魔仙。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PUDpacalNIavDT', '猪猪侠7 变身小英雄', '//img.funshion.com/pictures/339/744/0/3397440_m.jpg', '少儿,冒险,热血', '古志斌,陆锦明', '猪猪侠,菲菲,超人强,波比', '全52集', 4, '', '猪猪侠在一次怪兽侵袭事件中，阴差阳错激活了迷糊老师祖传的五灵锁，将五灵王转换成了能量，使自己获得了变身成铁拳虎、神木猿、冰封鹿、火焰鹤与石甲熊的超凡能力，从此肩负起了维护童话世界的安宁的重任……', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PUPkbZ7kMoC0ED', '捷德奥特曼 中文版', '//puui.qpic.cn/vcover_vt_pic/0/nug3wu4a6zvwy8s1498654532/0', '经典', '坂本浩一,长谷川眞优,市野龙一,阿部雄一', '滨田龙臣,山本千寻等,山本千寻长谷川真优,小泽雄太,山本千寻,潘惠美,长谷川真优,奥特曼', '全25集', 4, '', '奥特战士与贝利亚之间的战斗被地球人奉为传说一直流传了下来。在六年前的地球上曾出现过怪兽，那场混乱平息之后，人们一直过着和平的日子。主人公朝仓陆从小不知道自己的双亲是谁。他在小时候遇见了佩嘉萨星人——佩嘉，他目前住在星云庄内，是一位崇拜英雄的普通青少年。某天，六年前的怪兽再次出现！星云庄被它肆意践踏，小陆和佩嘉不知该逃往何处，此时他们意外地发现了藏在地底的秘密基地。从基地的莱姆那里拿到了“奥特胶囊”的小陆，变身成了捷德奥特曼！这位奥特战士成功击退了怪兽，但他的外形却酷似贝利亚。在那之后，怪兽们接二连三地出现，它们的目标都是能源体“利特鲁之星”。这一连串的事件背后隐藏着贝利亚的阴谋，察觉到这一点的赛罗奥特曼来到了地球。继承了贝利亚遗传基因的小陆，他与命运抗争，想要成为真正的英雄，战斗就此展开！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('PUTsbZ7mMIKvET', '超级飞侠 第十一季', '//4img.mgtv.com/preview/internettv/sp_images/ott/2021/12/3/dongman/405910/20211203113353430-new.jpg', '冒险,亲子,益智', '林君怡', '乐迪,超级飞侠', '全20集', 4, '', '本剧讲述以乐迪为首的众多拟人化飞机超级飞侠穿梭世界各地，为小朋友们派送包裹，并帮助他们解决各种问题的故事。新一季动画里，超级飞侠们将摇身一变，成为勇敢的愿望守护者；同时小朋友也加入愿望守护计划，和超级飞侠一起守护愿望。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Q4Frc07lTG8nNH', '海之谣', '//i0.letvimg.com/lc06_isvrs/202205/16/16/54/1c337b3d-29b3-469c-8efd-ec1418b9ef7f.jpg', '剧情,谍战,言情', '周德华', '黄曼,万思维,赵峥,傅淼,郭广平,黄猛,吴毅将,卞涛,张颖,王斯琼,李天洋,黄馨瑶,郑妙,赵铮,黄勐,任东霖,尹君正,李一宁,肖祥武,谢金,曾漪莲,于东江,陈长海,赵淑珍,杨超然', '更新至27集', 2, '', '抗战时期，大陈岛乡绅吴匡时拉起武装对抗日寇，渔民叶阿大为保护吴家二少爷再青，被日寇杀害。叶阿大儿子叶忠义与吴再青结拜为兄弟，兄弟俩同时爱上了戏班班主的女儿阿春。叶忠义遭迫害逃往大陆，成为解放军军官；吴再青随大陈人迁往台湾成为高级特工，但他仍念念不忘阿春。已是阿春丈夫的海防部队军人叶忠义为履行职责和保卫爱情，与再青展开新的角逐。改革开放后，分离了三十年的老人重逢并收获了各自的爱情。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Q4JuaH7lTG4tOH', '明天会更好', '//1img.mgtv.com/preview/sp_images/2022/04/25/202204251025546792662.jpg', '都市,剧情', '顾晶', '柴碧云,李倩,何明翰,邵峰', '更新至48集', 2, '', '讲述了一对情同姐妹的闺蜜，由相伴相知到因妒成恨的情感纠葛，在突出戏剧性、展现人物命运的同时，弘扬人性中的真善美，鞭笞假恶丑的故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Q4Nqan7lTzbtNX', '特战荣耀', '//m.ykimg.com/050E0000624527BD2037DD092D3DC2E2', '剧情,军事', '徐纪周', '杨洋,李一桐,蒋璐霞,高鑫,孟阿赛,周牧茵,蒋龙,刘硕,郭洺宇,吴健,沈晓海,石兆琪,谢静,刘硕（小）', '更新至45集', 2, '', '出生于军人家庭的燕破岳为了向父亲证明自己，在高考来临之际参军到了武警某支队。在新兵集训时，燕破岳训练成绩惊人，却不被中队长李祥看好，被分配到特战中队炊事班。炊事班中卧虎藏龙，燕破岳收敛心性投入工作。由于表现突出，燕破岳参加了武警特战队的选拔。为实现英雄梦，燕破岳一度注重自我、忽略集体。严酷的环境、艰巨的任务，让他认识到不足。在战友们的帮助下，他终于认识到团队的重要性和集体主义精神的真谛，理解了老中队长李祥的良苦用心，曾经的兵王继续磨砺自己。魂呼万里外，战死当如归！在一次次生与死的考验中，燕破岳不断成长，成为一名优秀的武警特战队员，坚守对党和国家的绝对忠诚和坚定信念，永远做党和人民的忠诚卫士。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Q4NrcH7lTG0pNn', '且试天下', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200v3lnbmd1649386229079/0', '言情,古装,武侠', '尹涛,于永刚', '杨洋,赵露思,宣璐,赖艺', '更新至40集', 2, '', '剧集讲述俊雅绝伦的黑丰息和风华绝世的白风夕，携手闯荡天涯的武侠爱情传奇。辗转十年，他们的爱情在鲜血中绽放，一场大战之后，黑丰息终于意识到了自己的真心，散尽自己修为救活了白风夕。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QbFqc07lTG8oNX', '传家', '//m.ykimg.com/050E00006281A8E813EB6609416832B2', '商战,言情', '王威,白云默', '秦岚,韩庚,吴谨言,聂远,张楠,刘钧,苗圃,张逸杰,何奉天,郑凯,郑国霖,张译兮,方安娜,汪汐潮,何佳怡,王可如', '更新至20集', 2, '', '该剧讲述了易氏家族三姐妹因不同个性而遭遇不同命运的故事。上世纪20年代末，上海百货巨子易氏家族遭遇承继危机，易兴华因独子易钟杰弃商从医，被迫召回长女钟灵、次女钟玉、幼女钟秀。钟灵乃名门淑女，典雅文静。钟玉由南洋巨贾外祖抚养，精明能干。钟秀留学美国，浪漫天真。三位千金生母不同、脾性不投、成长环境迥异，为继承星华百货，三人各出奇招，争执不休。易兴华未料三凤还巢引发轩然大波，恐伤及骨肉之情，迟迟无法选定最终继承人，反令三女之间误会重重、各奔东西。后来家族遭遇连番重创，陷入风雨飘摇之中，易氏子女为实现父亲实业兴国的夙愿，团结一致，共度时艰。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QbFqcX7lTG0qOX', '斗香', '//i3.letvimg.com/lc04_isvrs/202204/19/17/27/db8201ba-841e-446c-a5c3-71625d52a75d.jpg', '剧情,军事', '曾剑锋', '陈浩民,黄奕,刘述,田璐菡,张棪琰,舒耀瑄,张立威,谢其均,白瑶,许歌,石小满,刘婷,赵小锐,马达,妮娜,李勇,薛宾', '更新至36集', 2, '', '1937年秋，上海沦陷前夕，“亚洲第一香”的花城汪公馆陷入前所未有的迷茫与恐惧，汪太太和丈夫汪大酉预感花城将成地狱，要将儿女送出城去。 　　汪家少爷汪立伦和三位妹妹却因种种原因不想出城，一时迷雾重重，凶险四伏。汪立伦对身边的凶险毫不知情，充满幻想，要拍一部爱情电影。为应付汪太太和汪大酉包办的婚姻，他逼御香坊女工黄喜喜当他的契约女友，两人后来假戏成真，由憎生爱。他发现偶像明星王琦儿是汪大酉的“情人”汪太太口里的“狐狸精”，痛苦不堪，大病一场后在喜喜感召下振作起来。不想导演请来的女一号竟是王琦儿，经过种种磨擦后才消除误解。原来王琦儿是中共地下组织的人，接近汪立伦进入汪公馆也是党的任务。 　　汪太太是御香坊传人，深具炼香天赋，曾赴日深造，被卷入日军阴谋。她在霍医生催眠下，可怕的记忆渐渐苏醒，成了她心里的“伤疤”。她和徐记香坊掌柜徐小香斗，并派人去卧底；和丈夫汪大酉互不信任。她苦守祖业，剿外安内，心力交瘁。后汪太太和徐小香幡然醒悟，联手控诉日军罪行。 　　王琦儿和汪立伦、喜喜等人在市府舞会上发传单时被日军搜查，王琦儿为保护喜喜，被日军带走牺牲。 　　汪立伦和喜喜在经历种种变故后不断成熟，汪立伦明白了日军的伪善，他毁了亲日电影胶片，以口技帮汪太太诱来马市长、西村等人诱杀，摧垮了日军阴谋，加入了抗日阵营。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QbRrb07lTG4rNn', '风起陇西', '//pic8.iqiyipic.com/image/20220421/63/c4/a_100480869_m_601_m1_195_260.jpg', '历史,古装,悬疑,谍战', '路阳', '陈坤,白宇,聂远,尹铸胜,常远,杨颖,孙怡,俞灏明,王骁,董子健,郭京飞,李光洁,杨轶,张晓晨,刘亭作,赵峥,从瑞麟,张戈,侯玮涛,彭义程,陈凯文', '更新至24集', 2, '', '讲述在天下三分、烽火四起、英雄辈出的时代，两个不被乱世聚焦的“小人物”——陈恭与荀诩，在惊心动魄的谍战中爆发出夺目光辉，于历史之外谱写出一段英雄传奇。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QbVrba7mRWXmMn', '光荣大地', '//p0.qhimg.com/t018c0c53a3850b0566.png', '军事,言情', '齐星', '陈宝国,王全有,巍子,杜源,王奎荣,姚笛,崔林,赵春羊,刘佩琦,吕行,赵龙豪,彭心宜,姚增强,白恩,杨旸,秦焰,张汇仓,张定涵,沙景昌,张芷溪,卢琳,杨佳音,岳旸,洪京京', '更新至36集', 2, '', '年代剧《光荣大地》是由巍子主演的抗日战争到解放战争背景下的故事，该剧由曾执导过热播电视剧《爱在苍茫大地》、《师傅》的著名导演齐星执导。整个故事以“水家大院”为背景，讲述了抗日战争到解放战争期间，以水二爷为首的一群敢爱敢恨、不屈不挠的民族英豪，与日本人、国民党、土匪等各派势力誓死抗争的传奇故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QbVwan7lTzbuOH', '亲爱的小孩', '//pic8.iqiyipic.com/image/20220410/e3/1e/a_100480683_m_601_m3_195_260.jpg', '言情,家庭剧,自制,剧情,都市', '胡坤', '秦昊,任素汐,聂远,谢可寅,黄米依,姚橹,李勤勤,岳红,程雍,张帆（演员）,穆丽燕,钱漪,蒋奇明,朱颜曼滋,师悦玲,赵会南,郑颖娴,满昱彤,王红梅,李至强,盛云翼,王红梅（女）', '更新至34集', 2, '', '肖路与方一诺结婚多年，喜迎贵子。而就在生产当日，产房外兵慌马乱的肖路却意外缺席。随着孩子的出生，这对新手爸妈也开始迎接身份转换后的各种挑战。随着双方父母的介入，一系列家庭矛盾的频发，导致夫妻关系走向拐点与暗礁。多年后，已重组家庭的他们生活归于平静，禾禾这时却突患白血病。医生建议他们再生一个孩子来救命，这场救女引发的风暴最终会把几个家庭带向何方。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QE4kap7mMYGzDD', '猪猪侠之恐龙日记 第六季', '//4img.mgtv.com/preview/sp_images/2022/04/08/202204081554175073659.jpg', '益智,冒险', '王永健', '猪猪侠', '全26集', 4, '', '猪猪侠、阿五重返恐龙星，意外唤醒机器人阿七，从而恢复了阿五真正的虎星人身份。猪猪侠因为担心阿五，陪着他一起完成试炼任务。为此，他们不仅要齐心协力走出恐龙世界的蛮荒环境，到达勋章所在地；还要突破重重关卡，取得试炼徽章。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QEDtbJ7jNIG3Cj', '海绵宝宝 OVA版', '//pic1.qiyipic.com/image/20160121/ff/da/a_50218261_m_601_m4_195_260.jpg', '益智,青春,搞笑', 'Sherm Cohen', '海绵宝宝,派大星,蟹老板,章鱼哥,痞老板,Brian Doyle-Murray,小蜗,BrianDoyle-Murray', '全334集', 4, '', '海绵宝宝是一块居住在海洋深处的海绵(住所是一个大菠萝)，他是一个可爱、慷慨大方、友好、可信赖的好人。他露出龅牙的笑容，非常富有表现力的脸和身体，以及他纯真美好的天性使他非常可爱。特征：穿着方形裤子，黄颜色的海绵，露出两颗大牙齿。天真乐观，充满善意，但是尽管他出于好意，仍免不了陷入麻烦之中。他的宠物是一只会喵喵叫的小蜗，海绵宝宝喜欢捕捉水母，职业是蟹堡王里的头号厨师。派大星.章鱼哥和姗迪都是他的朋友。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Qk4kbp7kNIa3ED', '小公主苏菲亚英文儿歌DVD', '//p0.qhimg.com/t013718bbae9942d226.jpg', '亲子,启蒙英语,儿歌精选,儿歌', '未知', '未知', '全28集', 4, '', '好的英文儿歌能能让宝宝在轻松，欢快，自然的状态下，聆听歌声，感受音乐魅力，健康的成长。这是英语启蒙最简单易行的方法之一。现在和小公主苏菲亚一起学唱英文歌，最纯正英语轻松学！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QkLrb57mLoS1ED', '喜羊羊与灰太狼之决战次时代', '//1img.mgtv.com/preview/internettv/sp_images/ott/2021/7/3/dongman/376490/20210703144321393-new.jpg', '冒险,益智,搞笑', '梁嘉琪', '喜羊羊', '全60集', 4, '', '本剧集是《羊村守护者》系列的第四部作品，延续了之前系列妙趣横生的风格以及跌宕起伏的情节外，还创新性地呈现出高科技的未来世界，通过遇见未来的朋友，叙述羊狼间真挚的友情，既能让观看的小朋友产生巨大的新鲜感，又能使他们从故事背后读到友情、亲情的宝贵与美好，更加珍惜朋友间的情谊，同时传递出不怕困难、突破自我的正面价值观。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QLlwaH7lTzPsMH', '浴血青春', '//i0.letvimg.com/lc02_isvrs/202101/08/15/29/a1c9d106-c777-41e9-86e7-a558c2aa4cb6.jpg', '励志,军事', '武洪武', '李倩,叶静,潘阳,肖轶,郭金杰,丁冠中,董波,陈嘉男,崔嵩,颜世魁,钱波,于震,李勤勤,王海涛', '更新至43集', 2, '', '小麦是莫家集一个天真无邪的小姑娘。在一次日本兵来莫家集征民夫修路的时候，小麦被一个日本兵追到了池塘边，她在挣扎中意外地把日本兵蹬进池塘里淹死了。小麦得到了日本兵的步枪。日军以在村子里破案、找枪为由驻扎下来，真实目的是端掉附近国共两支抗日游击队的根据地。胆小懦弱的小麦从开始带着步枪到处躲避，逐渐成长为一个敢于主动出击杀鬼子的“刺客”，她一次次遭遇惊险，先后被猎户正月、八路军和国军游击队所救。小麦和正月也在患难中产生了感情。莫家集最终被日军血洗，小麦也明白了依靠自己一己之力是无法和侵略者对抗的，在八路军的正确引导下，小麦和正月成长为了合格的八路军战士。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QLNtbX7lTG8oMX', '欢迎光临', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200zhxlk581651810234413/0', '都市,言情,剧情', '李雪', '黄轩,白百何,朱雨辰,白宇帆,丁嘉丽,杨昆,柴碧云,薛昊婧,杨烁,岳旸,张佳宁', '更新至24集', 2, '', '《欢迎光临》讲述了生活在大城市的一群小人物的温暖和奋斗。酒店礼宾部的张光正善良忠厚，正义感和斗志掩藏在得过且过的表面之下，空姐郑有恩外头看着嚣张带刺，里头却是热心柔软，同是从事服务行业的两人偶然闯入了彼此的生活，张光正对郑有恩一见钟情，为接近郑有恩加入了有恩妈妈所在的广场舞队伍，每日的相处打破了他对广场舞阿姨的刻板印象，他带领阿姨们参加广场舞比赛、奋勇争先，曾经也拥有过花样年华的阿姨们鼓励张光正精神抖擞地面对生活。张光正和郑有恩的感情发展永远在人意料之外，但又在情理之中。人生从来不易，他们和身边的朋友们都曾心灰意冷过，而最终亦都选择全力以赴，王牛郎鼓起勇气面对内心的情意，陈精典不再害怕失败努力考研，佟娜娜逐渐找回自信，豆子积极争取每一个进步机会......偌大的城市中，一个个平凡而又光芒万丈地活着的人们，为了成为自己生活里的英雄不断努力着。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QLNub07lTG4uMn', '杠杆', '//m.ykimg.com/050E00006270FA8213F7FF0987E96C29', '悬疑,警匪,经侦', '刘光', '郭京飞,于毅,钱晓蕴,张丰毅,熊黛林,佟丽娅,张晞临,黄俊鹏,刘安康,邓凯匀,杜功海,石廷傲,高光佑,吴泳靓,王茗阳,龙沐春,冯国强,王燕阳', '更新至40集', 2, '', '故事主要围绕经侦处长萧剑（于毅 饰）破获以金融大鳄胥枫（郭京飞 饰）为主谋的谜团重重的金融案件，却在其后牵扯出更大的跨国洗钱集团。萧剑无意间得到了胥枫隐藏的日记，发现了胥枫苦苦隐瞒的另一重身份。强敌当前，施压在后，不懈追查的萧剑以责任感与使命感冲破重重困局，最终将庞大的金融犯罪组织一网打尽。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QLRwan7lTzTrMX', '人世间', '//pic8.iqiyipic.com/image/20220125/86/68/a_100480805_m_601_m2_195_260.jpg', '言情,历史,青春剧,家庭剧,都市', '李路', '雷佳音,辛柏青,宋佳,殷桃,成泰燊,丁勇岱,萨日娜,王阳,宋春丽,隋俊波,于震,张凯丽,冯雷,马少骅,黄小蕾,徐百慧,韩昊霖,陆毅,胡静,房子斌,丁海峰,白志迪', '更新至58集', 2, '', '该剧根据梁晓声的同名小说改编，以居住在北方某省会城市的一户周姓人家三代人的视角，描绘了十几位平民子弟在近50年时间内所经历的跌宕起伏的人生，全面展示了改革开放以来中国所经历的翻天覆地的社会巨变，歌颂了中国人民拼搏向上、艰苦奋斗的伟大历程，以及勤劳正直、自尊自强的美好内心。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QLVtb3KpRz0nOX', '断奶', '//p15.qhimg.com/t01aaa43f5259bf73e5.jpg', '伦理', '李力安', '佟丽娅,雷佳音,罗晋,林园,张小磊,王诗槐,郭凯敏,翁虹,陈鸿梅,杨昆,马妍婷,林源,马歌', '更新至32集', 2, '', '该剧以一对没有“断奶”的上海80后夫妻安琪与李俊鹏的婚恋为主线，表现了安，李两家作为50后父母的典型，从儿女婚姻到家务琐事乃至第三代养育一手包办，由此也引发了两家人之间的诸多不和。安琪和俊鹏虽然凭借自己的坚持为二人的婚姻扫清了障碍，可婚后的柴米油盐让四肢不勤五谷不分的二人无所适从，加上安琪的怀孕分娩，保姆亲戚的入住，让原本收入就不丰厚的二人更加捉襟见肘。两家父母在此时义无反顾地拿钱出来补贴二人，6+1家庭的育儿模式由此产生。两家父母的不愿“放手”和二人一贯的“精神啃老”，实现真正意义上的“断奶”是何其之难。俊鹏的后妈吴菲介入的买房风波致使宝宝受伤，差点害得安琪和俊鹏分道扬镳。深爱彼此的两人最终选择携手共同撑起自己的三口之家，彻底实现“断奶”，让操劳一辈子的父母最终放下心。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QrJpbn7lTzbqMX', '烽烟尽处', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200x0x6r301572494082/0', '军事,剧情', '连奕名', '张翰,焦俊艳,刘海宽,叶项明,武强,张雅玫,陈震,郭幸幸,金士杰,罗光旭（演员）,宿宇杰', '更新至39集', 2, '', '1937年7月，华北形势告急，日军准备发动全面侵华战争。察哈尔省黑石寨表明平静，实则暗流汹涌。远近闻名的才子张松龄与爱人举行婚礼前夕，惨遭汉奸陷害，家破人亡。张松龄痛定思痛，毅然投军。经历数次艰苦战斗的磨砺，他的军事素养得到飞速提升，更让他明白了军人的责任就是保护人民。后来张松龄身受重伤，辗转来到草原，加入了共产党领导下的游击队，团结草原人民，同仇敌忾，抗击日寇。张松龄看到了共产党的真诚与无私，意识到共产党才是中国的希望，他光荣的加入了中国共产党，成为游击队的领袖和红色抗日武装的中坚力量。张松龄带领队伍、团结人民，与侵略者、汉奸斗智斗勇，不畏艰辛，付出极大牺牲，终于成功地将侵略者赶出了草原。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QrRubH7lTG4uNX', '反转人生', '//1img.mgtv.com/preview/sp_images/2022/04/29/202204291418076682021.jpg', '都市,言情', '陈畅', '周依然,马思超,李川,曹恩齐,梁超,吴亚衡,刘园园,刘金龙,李明源,刘安琪,刘凌而', '更新至26集', 2, '', '一场意外让两个不同轨迹的人人生反转，小透明少女沐想想遇上风云人物乔南，互换身份开启爆笑人生。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QUDtbZ7kNYGuET', '宝宝巴士之美食总动员', '//1img.mgtv.com/preview/internettv/sp_images/ott/2018/dongman/322204/20180202141245259-new.jpg', '儿歌,幼教,亲子,益智', '宝宝巴士', '妙妙,奇奇', '全30集', 4, '', '小朋友们最爱的美食伴着新年的脚步来唱歌啦！欢快的节奏、活泼的语言、悦耳的歌声，更多精彩内容尽在“宝宝巴士启蒙音乐剧之美食总动员”！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('QUTtap7mMIa1Dz', '艾克斯奥特曼 普通话版', '//4img.mgtv.com/preview/sp_images/2022/01/13/202201131129470883508.jpg', '科幻,热血,冒险', '田口清隆,坂本浩一,辻本贵则,阿部雄一', '高桥健介', '全24集', 4, '', '讲述由于太阳发射的超级耀斑导致在地球地底和海底的火花人偶熔铁怪兽迪玛伽复活，“特殊防卫队Xio”队员大空大地在战斗中听到了迷之声音，此后与神秘之光结合而成为了“艾克斯奥特曼”。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('R4hraH7lTG4rOX', '新居之约', '//puui.qpic.cn/vcover_vt_pic/0/mzc00200frpbpgb1650764676821/0', '都市,言情', '余淳', '潘粤明,王鸥,孙坚,李艺彤,刘天佐,代斯,张凯丽,董璇,陈子由,张棪琰,马文忠', '更新至24集', 2, '', '杨光是一家小型装饰公司的经理，通透世故的他只想和气生财，照顾好亲人，可他对自家人的过分包容导致引火烧身，只好挂靠到大型装饰公司赢家，成为一名项目经理，也因此与天才设计师陈曦冤家聚头。杨光陈曦两人完全属于两个世界，还因误会彼此嫌弃，谁知一起工作时，竟意外合拍，在联手打造出良心优质的工程后，消融成见，成为搭档。行业内部乱象频出，一次次的困难和挫折没有击垮二人的原则和底线，反倒让他们更加坚定，努力为客户打造出“理想的房子”，并在这个过程中真正理解了“家”的含义。在他们的不懈努力下，正义战胜了邪恶，为行业铲除了一颗毒瘤，两人的事业更上一层楼，也收获了真挚的爱情。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('R4ZqaX7lTG8lNn', '对决', '//puui.qpic.cn/vcover_vt_pic/0/mzc002005030v2s1652149956030/0', '警匪,悬疑', '周琳皓', '欧豪,王景春,吕晓霖,丁勇岱,赵阳,邢瀚卿,李虹辰,王艺哲,赵雷棋,柳俊岐', '更新至22集', 2, '', '在经济发达的粤东省，罗元县却是个治安垫底的县城，席卷而来的扫黑除恶时代洪潮，将其裹挟其中。年轻刑警武剑在追查一起枪击案的途中遇到黑恶势力的阻碍，交回警队的证据不翼而飞，他无法洗脱嫌疑，只有文陆阳毅然选择相信武剑，并邀请他配合专案组的工作。行事不按套路出牌的文陆阳与粗中有细的耿直小伙武剑自此组成一对风格迥异的破案组合，两人在互相试探中互相影响，从枪击案到光头被杀案，抽丝剥茧，挖出罗元县最大的黑社会性质组织团伙——陈氏兄弟集团，然而案件背后，还有一把巨大的保护伞，牵涉着更为庞大的势力，他们将如何冲破当地黑恶阻碍，还人民一片清明？', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Rbpobn7lSGPlMX', '太行之脊', '//p0.qhimg.com/t0160b8862494e731a0.png', '军事,励志', '张玉中', '王晖,梁春书,陈大伟,董永,魏东,脱一然,李宗全,杨刚,杨均柏,史鑫,陈姗姗,张金华,任明生,李君峰,杨轶然,裴兴雷,何林翰,傅风男,杨骏,陈思思', '更新至30集', 2, '', '数十万日军会攻太原，山西告急，周恩来、朱德、彭德怀从战区分别急电毛泽东，建议第一二九师出动——自此拉开了八路军一二九师抗日征战的序幕。夜袭阳明堡，重叠设伏七亘村，扬威神头岭，截敌长乐村，挺进冀南平原，诱敌香城固，鏖兵白晋路、正太路，攻南关，打榆社，激战关家垴，开辟太行、太岳根据地，围困沁源，一系列卓有成效的战斗，见证了一二九师成长壮大的辉煌历程。毛泽东断言，扼太行者扼天下，刘邓率领的一二九师是真正的实践者，他们立足太行山，除与日寇坚决斗争、快速扩大武装外，同时在根据地推行减租减息、精兵简政、生产自救等一系列新政，迅速成长为华北、乃至全中国的一支抗战的中坚力量。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('RLRoan3kTGbqM3', '传奇英雄', '//p0.qhimg.com/t0174837c9d5df6dbbe.png', '大陆剧,抗日,军事,赵传奇,日本鬼子', '海顿', '杨童舒,颜丹晨,海顿,孙岚,李思思,王海地,王奎荣,郭铁城,郑晓宁,王圭荣,赵丽娟,杨峰', '更新至40集', 2, '', '1938年秋，汾梁山农民赵传奇以江湖手段绑架太原城日本商人，换回被日寇劫掳的乡亲，震动整个汾梁山区。在共产党与八路军的召唤下，赵传奇成为抗日革命队伍中的一员，以极其巧妙、另类的方式与日寇热血厮杀，成为令日寇闻风丧胆的抗日英雄“八路半”', 1, 0.0);
INSERT INTO `uni_video` VALUES ('RLRubH7lTG8pNH', '法医秦明之读心者', '//m.ykimg.com/050E0000628847A02037DD08EFFC12AD', '悬疑,剧情', '施磊', '张耀,汤敏,彭楚粤,马昕墨,刘冠成,程澄', '更新至13集', 2, '', '初入职场的秦明（张耀 饰）为了调查母亲遇害的谜团时意外被卷入一宗凶杀案，因此结识了安然（汤敏 饰）、林涛（彭楚粤 饰）、环环（马昕墨 饰）等一众法医和警员。剧中每一个案件背后都是一个社会话题，每一个案件独立却又与一个巨大阴谋有着千丝万缕的联系。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('RLRubH7lTzXmMn', '铁家伙', '//img36.pplive.cn/2022/02/16/18290596956_230X306.jpg', '历史,军事,抗战', '耿明吉', '王挺,刘一含,李立,胡浩博', '更新至37集', 2, '', '故事发生在1937年淞沪会战及1938年徐州会战之间，主人公坦克兵老狗在南京退往徐州的这一路上，遇到枪械师齐大昭，要去根据地的富少战地记者陆子游，江湖女混混黄桃，以及要回家娶媳妇的农民王四六。几人一同上路，路上偶得一辆日军废旧坦克。坦克兵老狗如获至宝，将其修好，开着坦克带着众人再次上路，与日本军官百鸟介统领的精英部队“旋风军”一路斗智斗勇，打的旋风军摸不着头脑。在老狗等人来到山东枣庄时，日本企图消灭中国第五战区主力的徐州会战打响。他们在隘口英勇地阻击日军，全部壮烈牺牲。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Y8AoaXNzA2A4Ej', '春日迟迟再出发', '//p0.qhimg.com/t0147b1cf4d2c9861e1.png', '情感,真人秀', '刘乐,涂涵', '大张伟,吴昕,吴克群,王霏霏,傅首尔,李松蔚,刘力绮,陆莹,莫非,林承纬,杨磊,赵亚楠', '2022-05-25期', 3, '', '八名尚未从前段失败婚姻带来的伤痛中痊愈的单身男女，结伴开启连续四个周末的“限定旅行”。他们在山林和大海间彼此陪伴、互相治愈，也在周间的挂念和周末的相聚中逐渐打开心门、重获心动与再爱一次的勇气。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Y8cna3NzAJk3Dj', '声生不息', '//4img.mgtv.com/preview/sp_images/2022/04/19/202204191816264909986.jpg', '音乐,真人秀', '何炅', '何炅,王祖蓝', '2022-05-29期', 3, '', '2022年时值香港回归祖国25周年之际，芒果TV、湖南卫视携手香港TVB特别企划献礼节目《声生不息》。节目召集来自香港和内地热爱港乐的16组歌手分为男女两队，通过6场主题竞演的对抗，改编演唱港乐传世金曲，完成港乐的新时代表达，寻找「港乐与我」的最大公约数，与观众共创一张「声生不息」港乐时代唱片。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Y8EobHNz8ZA7Dj', '向往的生活 第五季', '//p0.qhimg.com/t0128416c1d597c16bd.png', '真人秀', '未知', '何炅,黄磊,彭昱畅,张子枫,张艺兴,乔杉,刘晓邑,杨紫', '2021-07-30期', 3, '', '《向往的生活》是由湖南卫视推出的大型生活服务纪实节目。节目记录了何炅、黄磊、彭昱畅、张子枫等人一起守拙归园田蘑菇屋，为观众带来一幅“自力更生，自给自足，温情待客，完美生态”的生活画面。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Y8QqbHNz8pMBFT', '血战长津湖', '//photocdn.tv.sohu.com/img/20211111/vrsa_ver9732011.jpg', '文化,历史,科教', '未知', '未知', '2021-11-12期', 3, '', '真实纪录抗美援朝真实战役', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Y8YsbnNzA2EBDz', '欢迎来到蘑菇屋', '//0img.mgtv.com/preview/sp_images/2022/03/30/202203301818229176821.jpg', '真人秀', '未知', '陈楚生,曹恩齐,文韬,陆虎,罗予彤,齐思钧,石凯,邵明明,苏醒,王栎鑫,王铮亮,张远', '2022-04-22期', 3, '', '会员尊享治愈系慢综，《欢迎来到蘑菇屋》发起共享蘑菇屋的概念，开放《向往的生活》第五季桃花源蘑菇屋，邀请憧憬田园生活的客人来这里自行居住，留下各自不同的“向往生活”。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Yc5ncHNzA2I7Dz', '新游记', 'https://vmedia.qpic.cn/vcolumn/images/90161/1649917299991/0', '游戏', '严敏', '岳云鹏,黄子韬,张若昀,林更新,王彦霖,陈飞宇', '2022-05-29期', 3, '', '《新游记》讲述了6个男青年一路西行，历经特定人群的生活痛点，经历各种“难”和“难”，最终在最真实的人世间，获取了在平凡生活“真经”的故事。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('YcIqbKlv7JQ3Ez', '天天向上', '//p9.qhimg.com/t014c70d4043684a33a.jpg', '访谈,搞笑,真人秀,文化,脱口秀', '汪涵,大张伟,王一博', '汪涵,大张伟,王一博', '2022-05-29期', 3, '', '《天天向上》是湖南卫视于2008年8月重磅推出的一档文化公益脱口秀节目，由汪涵、钱枫、大张伟、王一博四位天天兄弟主持。现已成长为湖南卫视两大王牌节目之一，是湖南卫视周末娱乐节目最具标识性的节目。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('YcQlbnNz8pc6DD', '麻花特开心', '//m.ykimg.com/050E000061C3F5C11FD8520933DAFDB2', '真人秀,喜剧,搞笑', '未知', '沈腾,马丽,艾伦,常远,吴昱翰,黄才伦,王成思,许文赫,高海宝,李海银,田雨,宋阳,刘迅,许吴彬,李雪琴,宋祖儿,小沈阳,李诞,周洁琼,贾玲,林允,郑恺,杨超越,杨幂,李沁,许慧强,袁弘,赵小棠,陶亮,范丞丞,辣目洋子,赵一霖,胡铂,佟丽娅,徐峥', '2022-04-19期', 3, '', '《麻花特开心》是开心麻花首档团综。沈腾马丽带队出发，十二个奇妙的剧中世界，十二场沉浸式角色游戏，十二张热泪盈眶的笑脸。高能演技、爆笑反转、意外感动全线拉满。麻花全员，带你入戏！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Ys5kbXN072M2Ez', '一起探恋爱', '//m.ykimg.com/050E0000626A09AB13F7FF09D056F825', '真人秀,情感', '未知', '未知', '2022-05-29期', 3, '', '《一起探恋爱》是一档实景进行式剧场恋爱真人秀。恋综新玩法：进行式剧场+恋综。真实世界+游戏世界，让恋爱关系发生更多“反转”，催生更多可能！四个实景场地+上千个道具机关+数十个心动约会场景，教你在游戏中辨别真心！游戏王者是否能够逆袭成为爱情王者？剧本杀是一场游戏，但爱情不是游戏！在这里，只有付出真心，方能找到挚爱！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Ys5nb3NzA2A6ED', '王牌对王牌 第七季', '//m.ykimg.com/050E000062172A9A2037DD0CC1555532', '真人秀,游戏', '沈涛,宋亚轩', '沈涛,宋亚轩,华晨宇,关晓彤,贾玲,沈腾,郑恺,李小冉,刘涛,杨迪,黄才伦,李海银,茅威涛,姜鹏,张天阳,吴彤,沙溢,白敬亭,谭松韵,赵又廷,唐九洲,张子贤,陈国平,张若昀,赵文卓,张天爱,李庚希,赵玉平,章子怡,岳云鹏,黄景瑜,麦家,黄明昊,虞书欣,胡宇桐,姜广涛,黄家康,雷佳音,杨幂,董子健,郭京飞,杨颖,祖峰,王丽坤,周一围,张韶涵,汪苏泷,杨坤,吉克隽逸,梁龙（乐队）,梁龙,范丞丞,刘敏涛,周也,檀健次,秦海璐,金靖,包贝尔,金婧,蔡明,马东,王皓（喜剧演员）,史策,高海宝,王皓,王濛,张晚意,李一桐,贾乃亮,李光复,魏翔,佟丽娅,何晟铭,白凯南,郝瀚', '2022-05-16期', 3, '', '《王牌对王牌》是浙江卫视推出的原创室内竞技真人秀节目，由浙江卫视节目中心制作。节目每期围绕一个主题，邀请两支王牌团队，由两队固定队长各带领多名热门IP嘉宾进行PK对战，通过才艺比拼、游戏竞技，决出王牌中的王牌。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('YsAkbHN072Q7Ez', '奔跑吧 第六季', '//m.ykimg.com/050E0000627B18C01FD8520927AE1DD1', '真人秀,游戏', '未知', '胡彦斌,孟佳,林允,宋妍霏,孟子义,李晨,杨颖,郑恺,沙溢,蔡徐坤,白鹿,周深,唐九洲,容祖儿,毛晓彤,李铢衔,王鹤棣,张碧晨,张大大', '2022-05-29期', 3, '', '《奔跑吧 第六季》是浙江卫视推出的户外竞技真人秀，由浙江卫视节目中心星图工作室制作，由李晨、Angelababy、郑恺、沙溢、蔡徐坤、白鹿、周深担任常驻MC，以 “奔跑不停，爱你不变”为主题，传递出满满的温暖、幸福及爱意，带领观众开启全新一季的浪漫旅程。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Yscma3Nz8pg5ED', '朋友请听好 第二季', '//p0.qhimg.com/t01ba26e536b4cb00c8.jpg', '真人秀', '未知', '何炅,谢娜,井柏然,董子健,李荣浩,陈立农', '2022-05-20期', 3, '', '《朋友请听好》第二季是由芒果TV自制的一档声音互动陪伴类真人秀节目，节目讲述何炅回归梦想，邀请多年挚友谢娜及其他好友共同开办一档网络广播，通过声音互动来为全国听众排忧解惑。本季将继续广播小站的工作，延续第一季的温暖与陪伴。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('YsElcXNzA2E8FD', '喜欢你我也是 第三季', '//pic3.iqiyipic.com/image/20220330/29/b9/a_100431361_m_601_m4_260_360.jpg', '真人秀,观察', '未知', '蒋敦豪,秦霄贤,应采儿,周洁琼,张绍刚,沙溢,李一桐', '2022-05-27期', 3, '', '《喜欢你我也是》“唤醒季”选择多位具有恋爱困惑“黑凤梨恐惧症”的单身男女嘉宾为视角，聚焦青年单身群体的个人恋爱观成长变化，正视过往遗憾、直面自我不足、逐步清晰人生方向、解决恋爱困惑的全过程。旨在与“不会爱、不敢爱、不想爱”的众多观众人群一起，共同发掘恋爱的美好。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('YsQqbXNzAJgBDz', '为歌而赞第二季', 'https://p3-sign.bdxiguaimg.com/xigua-lvideo-pic/24ede2ac9812c92b15a697c973f30004~tpl-1_noop.jpeg?x-expires=1965853324&x-signature=jIlFAtUCetikjjZZix3bC9TnCuA%3D', '其他', '未知', '雷佳,王嘉尔,杨宗纬,郁可唯,袁娅维,马思唯,柳爽,王赫野', '2022-05-28期', 3, '', '《为歌而赞第二季》是浙江卫视与抖音联合出品的跨屏互动音乐综艺。这是第一档展现音乐社交属性的音乐通告竞技秀，歌手们将为自己的歌曲拼一次，即带着自己的新歌来PK抖音上的热歌，赢取更多曝光机会。同时，节目将打造一个汇集了抖音创作者的“百人团”，用他们的视角放大用户和观众刷抖音时的情感共鸣，最终沉淀出首个以社交热度为指标的音乐榜单。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Z8cla3Nz8pYCFD', '你好， 星期六', '//4img.mgtv.com/preview/sp_images/2021/12/30/202112301816052451782.jpg', '真人秀,搞笑', '未知', '何炅,蔡少芬,秦霄贤,王鹤棣,布瑞吉', '2022-05-28期', 3, '', '《你好星期六》自2022年1月1日起每周六20:10在湖南卫视播出，节目通过新奇多样的环节设置和兼具知识性、趣味性的创意内容，深度展现明星艺能。节目立意积极向上，紧跟时代潮流，引领青年文化，弘扬民族自信，呈现出震撼人心的视听大秀，是真诚匠心的精品综艺。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Z8cobHNzA2I7ET', '追星星的人第2季', '//pic7.iqiyipic.com/image/20220413/32/ad/a_100502504_m_601_260_360.jpg', '真人秀,科教', '未知', '吴奇隆,王耀庆,宋轶,郭俊辰,董思成,胡海泉,刘雨昕,王怡人,马天宇,任敏,孟鹤堂', '2022-05-30期', 3, '', '《追星星的人》是浙江卫视推出的中国首档星空下自驾露营青春慢综艺，以治愈综艺为载体，追逐极致浪漫的星空，丈量祖国大好河山，挖掘旅途之中人和人之间的温暖和爱意。节目在国产户外综艺领域首度聚焦天文资源，传播了天文知识，激发了大众天文热情，且带动了相关产业发展。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Z8UnbXN072c4ED', '萌探探探案第2季', '//pic4.iqiyipic.com/image/20220526/71/81/a_100480946_m_601_m1_260_360.jpg', '搞笑,真人秀,爱奇艺出品', '未知', '周也', '2022-05-28期', 3, '', '《萌探探探案》第二季作为一档IP推理欢乐解压真人秀，每期根据一部经典IP，进行实景还原、改编、“穿越”，爆笑演绎原剧片段；八位嘉宾组成“萌探家族”，通过剧情疑点及趣味游戏，获取案件线索，欢乐寻找真相。第二季更加入了影视化案情呈现，不止一场游戏，更似一场电影。节目旨在打造沉浸式的推理探案体验，向经典致敬的同时，也向社会传递emo拜拜，萌探嗨嗨的积极情绪指引。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZcEpbnN072M7Dz', '爸爸当家', '//2img.mgtv.com/preview/sp_images/2022/05/08/202205080947149216544.jpg', '其他', '未知', '未知', '2022-05-30期', 3, '', '《爸爸当家》节目聚焦当前社会“全职爸爸”育儿现象，邀请全职照顾孩子的四位素人爸爸，开启一场长达100天的爸爸当家生活，探讨家庭教育中男性角色的重要性，输出正向家庭教育观，展现良好家风，促进社会和家庭和谐，为国家新时期的生育政策助力。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('Zcgqa3NzA2ACFD', '春天花会开', '//p0.qhimg.com/t01cb28ef9b7d11d015.jpg', '音乐,真人秀', '未知', '雷佳,华晨宇,谭维维', '2022-05-27期', 3, '', '湖南卫视大型民歌竞唱节目《春天花会开》，节目以最具中国特色的民歌为题材，当代年轻人用自己的方式唱出心中最美的中国。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZcImcnNz8pE7Dz', '奔跑吧·黄河篇 第二季', '//m.ykimg.com/050E0000616FDA2513F7FF09800327F3', '真人秀', '未知', '李晨,沙溢,郑恺,杨颖,于洋,白鹿,林一,宋雨琦,秦霄贤,巩立姣,周深,王耀庆,魏大勋', '2021-11-28期', 3, '', '“九曲黄河万里沙，浪淘风簸自天涯”，这是专属于黄河的浩气磅礴。兄弟团们再次齐聚，沿着黄河流域一路探索，了解黄河沿岸全新的故事，这次的旅程会充满什么未知的惊喜呢？', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZcIobnNz7Zg8Ez', '明星大侦探 第六季', '//3img.mgtv.com/preview/sp_images/2020/12/17/20201217153358831.jpg', '真人秀', '未知', '何炅,撒贝宁,白敬亭,刘昊然,张若昀,杨蓉', '2021-03-17期', 3, '', '芒果TV《明星大侦探》第六季即将回归！悬疑搞笑，掀起脑洞风暴！', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZcMoaXNzA2E4Dj', '初入职场的我们·法医季', '//1img.mgtv.com/preview/sp_images/2022/03/11/202203111008353261612.jpg', '职场,科教,真人秀', '未知', '未知', '2022-05-30期', 3, '', '《初入职场的我们》第二季是职场奋斗纪实真人秀。节目延续第一季帮助年轻人适应职场、勇敢步入职场的核心理念，拟邀刘良（湖北同济法医学司法鉴定中心法医、央视年度法治人物）担任导师，聚焦对国家司法建设有重要贡献的法医行业，从中国各大警官、医科类院校招募5位实习生跟随法医刘良，真实记录他们30天的实践及考核历程。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZMApb3NzA2E7DD', '三个少年', '//m.ykimg.com/050E000062450FEF1FD852098D78EBA5', '真人秀,访谈', '沈涛', '沈腾,沈涛,宋亚轩,何运晨,唐九洲,鸟鸟,白敬亭,杨迪,赵又廷,张子贤,章子怡,赵英男 (奇葩说),赵英男,张天爱,华晨宇,冯琛,关晓彤,蔡明,贾玲,范丞丞,周也', '2022-05-26期', 3, '', '《三个少年》是一档互动演绎暖情聊天综艺，也是《王牌7》的衍生节目。节目聚焦时下热议话题，聆听年轻族群的声音，在欢乐温暖中让大众见证时代新力量。节目设立少年研究院，由3位求知少年担任研究员，每期和几位特邀专员，围绕时下热议话题，展开课题研究会，分享研究成果。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZsAobHNz8pg7FD', '大侦探 第七季', '//p0.qhimg.com/t01eedec14997b6ac73.jpg', '推理、游戏、真人秀', '晏吉', '何炅,张若昀,大张伟,王鸥,魏晨,杨蓉,戚薇,吴昕,乔振宇,张新成', '2022-05-13期', 3, '', '《大侦探》第七季是芒果TV自制的一档普法教育推理节目。节目中，每期嘉宾根据不同的案件主题，扮演不同的角色，在“案件现场”寻找证据，推理并找出真正的“凶手”。本季《大侦探》将与最高人民法院联合推出创新板块《大侦探合议庭》，每期邀请专家学者共同探索案件背后的成因以及所反映的社会热点问题，传递正确的价值观。', 1, 0.0);
INSERT INTO `uni_video` VALUES ('ZscmcXNzAJk2Ej', '向往的生活 第六季', '//4img.mgtv.com/preview/internettv/sp_images/ott/2022/4/22/zongyi/436655/20220422091345411-new.jpg', '其他', '未知', '未知', '2022-05-27期', 3, '', '《向往的生活》第六季将讲述蘑菇屋与大海的故事，实现蘑菇屋家人们去海边的愿望，探讨人与自然的和谐相处，体验梦幻与现实的交织。渔事小队用自己的双手，和朋友们一起，创造向往的渔村生活。', 1, 0.0);
